module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"2024-summary","metadata":{"permalink":"/whatap-docs/blog/2024-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-summary.mdx","source":"@site/blog/2024-summary.mdx","title":"와탭 24년 안내","description":"와탭의 2024년 1월부터 10월까지 진행된 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-11-19T19:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2024","permalink":"/whatap-docs/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-summary","title":"와탭 24년 안내","authors":"ysj","date":"2024-11-19T19:30","toc_max_heading_level":2,"tags":["새로운 기능","2024"],"isTranslationMissing":false},"unlisted":false,"nextItem":{"title":"서비스 개요","permalink":"/whatap-docs/blog/overview"}},"content":"와탭의 2024년 1월부터 10월까지 진행된 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n{/* 새로운 기능 sc 이미지 국문과 영문 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n{/* > * <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 메뉴 및 <Cmdname sid=\\"side_integratedRealtimeAlert\\" className=\\"uitext\\" /> 등 경고 알림 기능이 개선되었습니다.  */}\\n> * **SSO 계정 연동** 기능이 추가되었습니다.\\n> * <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴를 새롭게 제공합니다. \\n> * `Application`, `Kubernetes`, `Database` 상품군에서 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴를 새롭게 제공합니다. \\n\\n{/* 공통 메뉴 개선 또는 이벤트 v2 메뉴 개선 \\n\\n> * 편의성 향상을 위해 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴가 개선되었습니다.\\n\\n*/}\\n\\n|**Application**|\\n|---|\\n\\n> * 공통 메뉴가 개선되었습니다.\\n> * <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />이 고도화되었습니다. \\n> * `Go` 상품 베타 서비스를 종료하고 **정식** 서비스를 제공합니다.\\n> * <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />에 기본 프리셋 변경 기능이 추가되었습니다.\\n> * `Java` 상품이 데이터베이스 **연계 분석**을 제공합니다.\\n\\n{/* > * `Node.js` 상품이 로그 모니터링을 제공합니다.\\n> * `.NET` 상품이 멀티 트랜잭션을 지원합니다. */}\\n\\n{/* > * `.NET` Core 라이브러리 지원 범위가 확대되었으며 멀티 트랜잭션을 지원합니다.  */}\\n{/* > * 애플리케이션과 데이터베이스 상품 연계 모니터링을 지원합니다. (10월) */}\\n\\n|**Server**|\\n|---|\\n\\n> * Unix **AIX**, **Oracle Solaris**, **HP-UX** 설치 패키지를 제공합니다.\\n> * <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n\\n|**Kubernetes**|\\n|---|\\n\\n> * **컨트롤 플레인 모니터링**을 새롭게 제공합니다. 컨트롤 플레인 컴포넌트 중 kube-apiserver 모니터링을 위해 <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n> * 기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> 기능을 제공합니다. \\n> * Deployment 기준으로 관련 정보를 조회할 수 있는 <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n> * 마스터 및 노드 에이전트 설치 시 *Helm* 차트 설치를 지원합니다. \\n> * <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> 화면이 보다 손쉬운 옵션 선택 방식으로 개편되었습니다.\\n> * <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 메뉴가 새롭게 개편되었습니다. \\n> * <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 메뉴에서 ***리소스 관계도***를 제공합니다. \\n> * <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. \\n> * <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"node\\" /> 기능을 새롭게 제공합니다. \\n> * <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다.\\n> * <UI>Ingress 목록</UI> 메뉴를 새롭게 제공합니다.  \\n\\n{/* \\n\\n> * 쿠버네티스 노드 모니터링 확장의 일환으로 <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. \\n> * 쿠버네티스 구성 요소의 분석 기능을 강화하여 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능을 새롭게 제공합니다. \\n> * 쿠버네티스 모니터링 정보 확장의 일환으로 <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n\\n*/}\\n\\n|**Database**|\\n|---|\\n\\n> * `MongoDB`와 `Redis`, `Oracle`, `Altibase`, `Cubrid` 상품에서 차트 및 수집 기능을 강화한 새로운 <code class=\\"my\\">V2</code> 서비스를 제공합니다.\\n> * `Oracla Pro` 상품 **정식** 서비스를 제공합니다. \\n> * <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴의 개선이 이루어졌습니다.\\n> * `PostgreSQL`, `MySQL`, `Oracle` <code class=\\"my\\">V2</code> 및 `Oracla Pro` 상품이 애플리케이션 **연계 분석**을 제공합니다. \\n\\n:::note \\n\\n* 현재 데이터베이스 <code class=\\"my\\">V2</code> 지원 플랫폼은 다음과 같습니다.  \\n\\n  `PostgreSQL`, `MySQL`, `MongoDB`, `Redis`, `Altibase`, `Cubrid`, `Oracle`, `Oracle Pro`\\n\\n* 데이터베이스 플랫폼별 <code class=\\"my\\">V2</code> 지원 에이전트 버전은 다음과 같습니다. \\n\\n  `PostgreSQL`(v1.6.7), `MySQL`(v1.6.8), `MongoDB`(v1.7.0), `Redis`(v1.7.0), `Altibase`(v2.0.0), `Cubrid`(v2.1.0), `Oracle`(v1.9.0), `Oracle Pro`(에이전트 별도 제공)\\n\\n:::\\n\\n{/* > * 애플리케이션과 데이터베이스 상품 연계 모니터링을 지원합니다. (10월, 10월에 또 클라우드 지표 긁어오는 거 가능) */}\\n\\n|**Browser**|\\n|---|\\n\\n> * <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능을 새롭게 제공합니다. \\n> * <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능을 새롭게 제공합니다. \\n> * <UI>페이지 로드 통계</UI> 기능을 새롭게 제공합니다. \\n\\n\\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품이 **정식**으로 출시되었습니다. \\n\\n\\n|**Features**|\\n|---|\\n\\n> `KAFKA`, `Aerospike`, `Apache Pulsar`, `NGINX`, `vCenter`, `APACHE` **베타** 서비스를 제공합니다. \\n\\n\\n|**Log**|\\n|---| \\n\\n> <UI>로그 검색</UI> 및 <UI>라이브 테일</UI> 메뉴에서 검색 조건 즐겨찾기 기능을 제공합니다. \\n\\n\\n\\n{/* \\n\\n오버뷰 추가 건들 \\n\\n- node.js: svelt 설치 가능 문서 업데이트 (완)\\n\\n- PostgreSQL: 티맥스 지원 (완)\\n\\n체인지로그 추가 건들\\n\\n- 디비 전 제품 지표 업데이트 \\n\\n*/}\\n\\n</div>\\n\\n\\n{/* 상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다. */}\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n{/* 와탭 2024년 1분기 `공통` 부분의 주목할 만한 신규 기능으로 사이드 메뉴 개편, SSO 계정 연동 기능 추가 및 새로운 이벤트 설정 기능을 소개합니다.  */}\\n\\n{/* 사용자 편의성 향상을 위해 5년 만에 와탭 모니터링의 **사이드 메뉴**가 새롭게 개편되었습니다. 와탭 서비스 이용에는 프로젝트 선택이 선행됩니다. 프로젝트 생성 및 선택 이후 동선을 편리하게 활용할 수 있도록 기존과 비교해 UI 혼잡도를 줄여 프로젝트 선택과 메뉴의 영역을 확보하는 구조로 개편되었습니다. \\n\\n프로젝트 목록을 선택한 부분만 펼쳐서 확인할 수 있으며, 세로 영역을 확보해 보다 편하게 다양한 기능 메뉴를 조회할 수 있습니다. 또한 간단한 별 모양(<LinkImage img=\'ic-star.svg\' desc=\'비교하기 아이콘\'/>) 아이콘 클릭으로 상품별 프로젝트 메뉴 내 자주 쓰는 기능들을 즐겨찾기 할 수 있습니다. \\n\\n<ImgLang img=\'release/release-main-ui.png\' desc=\'사이드 메뉴 개편 cl 분기 예시\' /> */}\\n\\n### SSO 계정 연동\\n\\n**SSO 계정 연동 기능**이 추가되었습니다. 클라우드 기반 사용자 계정 관리 및 접근 권한 관리 솔루션 **Okta**와 와탭 모니터링을 연동할 수 있습니다. 조직 내에서 사용 중인 **Okta** 계정을 이용해 와탭 서비스에 로그인 후 서비스를 이용할 수 있습니다. \\n\\n<ImgLang img=\'sso-check-sso-info.png\' desc=\'sso-info cl 분기 예시\' />\\n\\n### 이벤트 설정 <code class=\\"newfunc\\">New</code>\\n\\n새로운 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 기능은 필드(Field) 중심의 사용자 경험을 강화하여 카테고리보다 필드를 먼저 선택하는 방식으로 사용자가 인지하는 지표와 이벤트 설정의 불일치를 해소했습니다. 또한 상품에 적합한 기본 이벤트 템플릿을 제공해 보다 쉽게 경고 알림 이벤트를 설정할 수 있습니다. \\n\\n![이벤트 v2 cl 분기 예시](/img/changelog/changelog-common-event-v2.png)\\n\\n기존 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 및 새로운 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴에 검색 기능이 추가되었습니다. 이벤트 목록 오른쪽 상단의 검색 입력창을 통해 <Cmdname sid=\\"event_title\\" className=\\"uitext\\" />, <Cmdname sid=\\"ITM07659\\" className=\\"uitext\\" />를 기준으로 문자열을 입력하거나 <Cmdname sid=\\"event_name\\" className=\\"uitext\\" /> 또는 <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> 중 원하는 기준을 선택 후 문자열을 입력하여 이벤트를 검색할 수 있습니다. \\n\\n![공통 이벤트 검색 분기 예시](/img/changelog/changelog-24q3-common1.png)\\n\\n### 메트릭스 차트 <code class=\\"newfunc\\">New</code>\\n\\n`Application`, `Kubernetes`, `Database` 상품군 공통으로 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴가 새롭게 개편되었습니다. <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code>는 사용자 경험을 대폭 개선하여 모니터링 작업을 더욱 효율적으로 수행할 수 있도록 설계되었습니다. \\n\\n![공통 메트릭스 차트 v2 분기 예시](/img/changelog/changelog-24q3-common-metrics-chart.gif)\\n\\n{/* ![공통 메트릭스 차트 v2 분기 예시2](/img/changelog/changelog-24q3-common-add_chart.gif) */}\\n\\n사용자는 ***시간***, ***대상***, ***인터벌*** 설정을 한 번에 처리하고 쉽게 차트를 추가할 수 있습니다. 또한 대시보드 위젯의 시간 범위를 자유롭게 변경할 수 있으며 일괄 변경 기능과 프리셋 기능을 통해 설정 관리가 간편해졌습니다. 이와 더불어 대시보드 레이아웃과 위젯도 자유롭게 조정할 수 있어 차트 분석이 더욱 효율적으로 개선되었습니다.\\n\\n{/* 다음 개요 안내를 통해 2024년 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_1q from \\"../crw-data/crwld-service/_import-service-Common.mdx\\";\\n\\n<Common_1q />\\n\\n</details> */}\\n\\n:::note \\n\\n* 사이드 메뉴 개편에 대한 자세한 내용은 [다음 문서](https://www.whatap.io/bbs/board.php?bo_table=blog&wr_id=214)를 참조하세요. \\n\\n* SSO 계정 연동 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/account/sso)를 참조하세요. \\n\\n* 새로운 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code>에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/warning-notice-v2)를 참조하세요. \\n\\n* 새로운 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴에 대한 자세한 내용은 [다음 문서](../java/metrics-chart-v2)를 참조하세요.\\n\\n:::\\n\\n<br/>\\n\\n\\n## `Application`\\n\\n{/* 와탭 2024년 1분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 `Go` 상품의 정식 출시, <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />의 고도화, 그리고 <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴 구조의 개선을 소개합니다.   */}\\n\\n### `Go` 정식 출시\\n\\n`Go` 애플리케이션 모니터링이 베타 버전 종료 후 **정식** 서비스를 시작했습니다. 와탭의 `Go` 애플리케이션 모니터링은 웹 프레임워크를 지원하고, Go Runtime 패키지의 정보를 지속적으로 수집합니다. 또한 MSA 환경에서 연계 추적을 통해 호출 관계를 수집합니다. \\n\\n### 공통 메뉴 개선\\n\\n<Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" />와 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴의 경우 각 메뉴의 탭 메뉴 구성을 개별 하위 메뉴로 구성하는 등 동선과 안정성 향상을 위한 개선 작업이 이루어졌습니다.\\n\\n![통계 및 인스턴스 성능 모니터링 sc cl](/img/changelog/changelog-app-stat-instance.png)\\n\\n### 트랜잭션 맵 고도화\\n\\n<Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />은 성능 테스트 또는 장애 상황 발생 시 단기간 트랜잭션별 현황을 상세히 확인할 수 있는 메뉴입니다. 다음과 같이 <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 고도화 작업이 이루어졌습니다. \\n\\n기존 TX 트레이스 섹션을 제거한 대신 차트 드래그 시 <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> 팝업 창을 통해 상세 정보를 확인할 수 있도록 구조를 개선했습니다. 또한 트레이스 분석 건수를 기존 100건에서 **1000**건으로 확장해 이전보다 10배 많은 트레이스를 분석할 수 있게 되었습니다. \\n\\n그외에도 한 화면에서 필터를 적용해 동작을 최소화하는 방향으로 **필터** 기능을 개선하였습니다. 예를 들어 트랜잭션 필터를 이용해 선택한 트랜잭션만 선별해 조회할 수 있습니다. 그리고 기존 실시간 최대 5분 뿐만 아니라 과거 시점 최대 10분까지 데이터를 조회할 수 있도록 변경해 전반적으로 편의성을 향상시켰습니다.  \\n\\n {/* 그외에도 ***Top 30*** 섹션에 IP 필터 기능을 추가했고, <Cmdname sid=\\"multi_transaction\\" className=\\"uitext\\" /> 탭에서 프로잭트 선택 상태를 저장하는 등 트랜잭션 분석 시 편의성을 전반적으로 향상시켰습니다.  */}\\n\\n<ImgLang img=\'changelog/changelog-app-tx-map.png\' desc=\'sc\' className=\'changelog-img\'/>\\n\\n또한 응답 시간 분포도 차트에서 선택한 항목만을 조회할 수 있는 **커스텀 필터** 기능을 새롭게 제공합니다. 기존 ***TOP 30*** 섹션 옆의 <Cmdname sid=\\"custom\\" className=\\"uitext\\" /> 탭에서 조회를 원하는 특정 트랜잭션, 도메인, IP 항목에서 원하는 값을 직접 입력하거나 ***TOP 30*** 목록에서 제공하는 항목을 선택하세요. 선택한 항목들의 응답 시간 분포도가 차트에 실시간으로 필터링됩니다. \\n\\n<p align=\\"center\\"> \\n\\n![트랜잭션 맵 커스텀 필터 분기 예시](/img/changelog/changelog-24q2-app-trs-map.gif)\\n\\n</p>\\n\\n### 애플리케이션 대시보드 프리셋\\n\\n<Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> 메뉴로 처음 진입했을 때 조회할 수 있는 대시보드 기본 프리셋을 변경할 수 있습니다. 선호하는 대시보드 구성을 기본 프리셋으로 설정함으로써 보다 개인화된 사용자 경험을 제공합니다. 위젯 선택과 배치를 원하는대로 수정 후 대시보드 오른쪽 위에 있는 프리셋 선택 상자에서 <Cmdname sid=\\"BTN08106\\" className=\\"uitext\\" /> 옵션을 활용해 보세요. 기본으로 지정한 대시보드는 프리셋 목록에서 <code class=\'default-tag\'>기본</code> 태그가 표시됩니다. \\n\\n![애플리케이션 대시보드 기본 프리셋 분기 예시](/img/changelog/changelog-24q2-app-preset.png)\\n\\n{/* 안정적으로 각 기능을 사용할 수 있도록 / 기존 문제 개선 및 다양한 안정화 작업을 진행했습니다. */}\\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. */}\\n\\n{/* <code class=\\"New\\">New</code> `Go` 모니터링 상품 **정식 서비스** 시작 <code class=\'changelog-service\'>Service 2.2.4​</code> */}\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_1q from \\"../crw-data/crwld-service/_import-service-Application.mdx\\";\\n\\n<Application_1q />\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_1q from \\"../crw-data/crwld-agent/_import-agent-java.mdx\\";\\n\\n<Java_agent_1q />\\n\\n### `PHP`\\n\\nimport PHP_agent_1q from \\"../crw-data/crwld-agent/_import-agent-php.mdx\\";\\n\\n<PHP_agent_1q />\\n\\n### `Python`\\n\\nimport Python_agent_1q from \\"../crw-data/crwld-agent/_import-agent-python.mdx\\";\\n\\n<Python_agent_1q />\\n\\n### `Node.js`\\n\\nimport Node_agent_1q from \\"../crw-data/crwld-agent/_import-agent-nodejs.mdx\\";\\n\\n<Node_agent_1q />\\n\\n### `Go`\\n\\nimport Go_agent_1q from \\"../crw-data/crwld-agent/_import-agent-golang.mdx\\";\\n\\n<Go_agent_1q />\\n\\n</details> */}\\n\\n:::info\\n\\n* 애플리케이션 `.NET` 상품의 지원 범위가 기존 `.NET` Framework뿐만 아니라 `.NET` Core까지 확대되었습니다. \\n\\n* `.NET` 상품이 멀티 트랜잭션을 지원합니다.\\n\\n* `Node.js` 상품이 로그 모니터링을 제공합니다.\\n\\n:::\\n\\n:::note \\n\\n* <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 메뉴의 **커스텀 필터** 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/dashboard-transactionmap#custom)를 참조하세요. \\n\\n* <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> 기본 프리셋 변경에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/dashboard#changepreset)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_statIp\\" className=\\"uitext\\" /> 메뉴에 대한 자세한 설명은 [다음 문서](../java/analysis-apm-trs#statiptx)를 참조하세요.\\n\\n* <Cmdname sid=\\"side_threadList\\" className=\\"uitext\\" /> 메뉴에 대한 활용 안내는 [다음 문서](../best-practice-guides/about-instance-performance-analysis#advanced-use-thread-list-dump)를 참조하세요. \\n\\n:::\\n\\n\\n<br/>\\n\\n## `Server`\\n\\n{/* 와탭 2024년 1분기 `Server` 상품의 주목할 만한 신규 기능 및 변경 사항으로 **Unix** `AIX` 설치 패키지에 대해 소개합니다.  */}\\n\\n### Unix 기반 운영체제 지원 확대 및 설치 개선 \\n\\n와탭은 **Unix** `AIX`, `Solaris`, `HP-UX` 설치 패키지를 제공합니다. 해당 패키지를 다운로드 받은 후 실행하는 것만으로 간단하게 설치할 수 있습니다. \\n\\n* `AIX` 6.1 버전 이상을 지원\\n\\n* `Solaris` 버전 11.2 이상을 지원\\n\\n* `HP-UX` Itanium 버전 11.23과 PA-RISC-UX 버전 11.23을 지원\\n\\n또한 서버 모니터링 상품 설치 과정이 보다 직관적인 방식으로 개선되었습니다. 기존의 운영 체제별 탭 분리 방식 대신 사용자가 운영 체제를 먼저 선택 후 해당 OS에 맞는 개별 설치 페이지로 이동합니다. \\n\\n![서버 모니터링 설치 페이지 sc](/img/changelog/changelog-24q2-server.png)\\n\\n{/* 이번 1분기에 새롭게 **Unix** `AIX` **에이전트 설치 패키지**를 제공합니다. IBM이 개발한 AIX는 엔터프라이즈 서버에서 주로 사용됩니다. 확장성, 호환성, 엔터프라이즈 환경에서의 견고함을 위해 특별히 설계된 운영체제입니다. \\n\\n와탭은 **AIX 버전 6.1** 이상을 지원합니다. `AIX` 설치 패키지를 통해  */}\\n\\n{/* ![AIX sc cl](/img/changelog/changelog-server-aix.png) */}\\n\\n### 서버 구성 정보 \\n\\n와탭은 새롭게 <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴를 제공합니다. <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" />는 서버의 물리적 특성 및 가상적 특성, 운영 환경 등을 체계적으로 관리하기 위한 기능입니다. 자동으로 수집된 서버 구성 요소와 사용자 정의 항목을 통해 서버의 구성을 상세하게 파악하고 관리하는 것이 가능합니다. \\n\\n![서버 구성 요소 sc](/img/changelog/changelog-24q3-server-inventory.png)\\n\\n사용자 정의 항목을 통해 커스텀 컬럼을 구성하여 서버 상태 및 성능을 더욱 세밀하게 모니터링하고 이슈 상황에 대응할 수 있습니다. 예를 들어 각 서버 담당자와 직접적인 소통이 용이하도록 운영 담당자 정보를 추가하여 문제 시 빠른 대응이 가능합니다. 또한 <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴는 3단계의 다중 정렬을 통해 조건에 맞는 서버를 빠르게 필터링 할 수 있습니다. 기본 정렬은 ***OS 타입***, ***모델***, 그리고 ***시리얼 정보*** 기준입니다. \\n\\n{/* \\n\\n서버 구성 정보 활용 예시 요약1:\\n\\n\\t•\\t라이선스 산정: 서버의 CPU, X86 socket, 물리 및 logical core 정보 등을 자동 수집하여 라이선스 비용 산정을 빠르게 처리할 수 있습니다.\\n\\t•\\tH/W 장애 대응: 장애 발생 시, 와탭 서버 구성정보를 활용해 관련 서버와 담당자 정보를 신속히 확인하고 파트 교체 작업을 효율적으로 진행할 수 있습니다.\\n\\t•\\t필터링 지원: 자동 수집된 서버 데이터를 바탕으로 특정 IP 대역의 서버를 필터링하여, 작업 시간에 대비한 사전 준비를 손쉽게 할 수 있습니다.\\n\\t•\\t커뮤니케이션 지원: 사용자 정의 컬럼을 통해 서버와 서비스를 연결, 인프라와 현업 간의 의사소통을 원활하게 할 수 있습니다.\\n\\n서버 구성 정보 활용 예시 요약2: \\n\\n\\t•\\t서버 상태 확인: 운영 중인 물리적 및 가상 서버의 현재 상태를 빠르게 파악할 수 있습니다. 예를 들어, 서버별 OS 버전이나 펌웨어 상태를 한눈에 볼 수 있어 업그레이드나 패치가 필요한 서버를 즉시 확인할 수 있습니다.\\n\\t•\\t운영 담당자 관리: 대시보드에 커스텀 항목으로 운영 담당자 정보를 추가하면, 각 서버의 담당자와 직접적인 소통이 가능하여 문제 발생 시 빠른 대응이 가능합니다.\\n\\t•\\t장비 교체 및 관리: 모델 번호와 시리얼 번호를 기준으로 특정 장비의 교체 주기나 보증 기간 등을 관리할 수 있습니다.\\n\\n서버 구성 정보 대시보드는 서버의 중요한 데이터를 효율적으로 관리하고, 필요한 정보에 신속하게 접근할 수 있도록 돕는 핵심 기능입니다. 사용자는 이를 통해 서버 자산을 체계적으로 관리하고, 운영 효율성을 크게 향상시킬 수 있습니다.\\n\\n서버 구성 정보 활용 예시: \\n\\n1.\\t라이선스 산정 요청에 대한 신속한 응답 처리\\n\\t•\\tS/W 라이선스를 도입할 때, 각 서버의 CPU 정보를 확인해야 하는 상황이 발생할 수 있습니다. 예를 들어, X86 소켓 개수, 물리 코어 개수, 또는 논리 코어 개수를 요구할 때가 있습니다.\\n\\t•\\t서버 구성정보가 자동으로 수집되고 최신 상태를 유지하면, 인프라 운영자는 해당 정보를 빠르게 필터링해 CSV 파일로 다운로드하여 요청자에게 제공할 수 있습니다.\\n\\t•\\t이를 통해 서버에 일일이 로그인해 수작업으로 데이터를 수집하는 번거로운 과정을 생략할 수 있으며, 업무 효율성을 크게 향상시킬 수 있습니다.\\n\\n2.\\tH/W 장애 대응\\n\\t•\\t예를 들어 F/C Adapter(파이버 채널 어댑터) 장애가 발생하여 교체가 필요한 상황에서, 여러 개의 OS가 설치된 하드웨어의 정보를 정확하게 파악해야 합니다.\\n\\t•\\t와탭의 서버 구성정보를 통해 해당 하드웨어의 시리얼 번호 및 설치된 OS 목록, 담당자 정보를 미리 파악할 수 있습니다.\\n\\t•\\t사용자 정의 컬럼을 사용하여 OS별 담당자나 물리적 위치 등의 추가 정보를 관리함으로써, 해당 정보를 기반으로 신속하게 작업 일정을 잡고 파트 교체 작업을 진행할 수 있습니다.\\n\\n3.\\t다양한 필터를 통한 작업 지원\\n\\t•\\t네트워크 스위치 교체 작업 시, 서비스에 영향을 줄 수 있는 서버들을 필터링하여 담당자들에게 작업 시간 동안 대기 요청을 할 필요가 있습니다.\\n\\t•\\t와탭을 통해 서버의 IP 목록을 자동으로 수집하고, 특정 IP 대역을 사용하는 서버들만 필터링하여 필요한 정보를 신속하게 파악할 수 있습니다.\\n\\n4.\\t인프라와 현업(서비스) 간의 커뮤니케이션 개선\\n\\t•\\t인프라 운영자는 서버 이름을, 현업 담당자는 서비스 이름을 기준으로 작업하는 경우가 많아, 장애 발생 시 의사소통에 어려움이 생길 수 있습니다.\\n\\t•\\t이를 해결하기 위해 사용자 정의 컬럼을 활용해 서버와 관련된 서비스를 연결하는 서비스 토폴로지 맵을 구성할 수 있습니다. 이를 통해 인프라 담당자와 현업 담당자가 효율적으로 소통하고, 장애 대응 속도를 높일 수 있습니다.\\n\\n결론적으로, 서버 구성정보의 자동화와 현행화는 업무 효율성을 크게 높이고, 다양한 상황에서 신속한 대응과 협업을 가능하게 합니다.\\n\\n서버 구성 정보 다중 정렬 기본 예시: \\n\\t•\\tOS 타입으로 정렬하면 운영 체제별 서버 상태를 한눈에 확인할 수 있어, 특정 OS에 대한 패치나 관리 작업이 필요한 경우 유용합니다.\\n\\t•\\t모델 기준 정렬은 서버 하드웨어의 종류나 스펙에 따라 자원을 최적화하고, 특정 모델에서 발생하는 문제를 분석하는 데 도움이 됩니다.\\n\\t•\\t시리얼 정보는 개별 서버를 고유하게 식별할 수 있어, 특히 대규모 환경에서 특정 서버를 신속하게 찾아야 할 때 편리합니다.\\n\\n*/}\\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. */}\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_1q from \\"../crw-data/crwld-service/_import-service-Server.mdx\\";\\n\\n<Server_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_1q from \\"../crw-data/crwld-agent/_import-agent-server.mdx\\";\\n\\n<Server_agent_1q />\\n\\n</details> */}\\n\\n:::note \\n\\n<Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴에 대한 자세한 내용은 [다음 문서]( ../server/server-inventory)를 참조하세요. \\n\\n:::\\n\\n\\n<br/>\\n\\n## `Database`\\n\\n{/* 와탭 2024년 1분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 **Redis**와 **MongoDB** 상품 <code class=\\"my\\">V2</code> 출시에 대해 소개합니다. */}\\n\\n### 데이터베이스 <code class=\\"my\\">V2</code>\\n\\n와탭 `Database` 상품군이  <code class=\\"my\\">V2</code>로 전환되고 있습니다. 23년 4분기 **PostgreSQL**과 **MySQL**에 뒤이어 24년 와탭 데이터베이스 상품군 중 **Redis**, **MongoDB**, **Altibase**, **Cubrid**, **Oracle** <code class=\\"my\\">V2</code> 서비스를 제공합니다. <code class=\\"my\\">V2</code>는 전반적으로 차트 및 수집 기능이 강화되었습니다.  \\n\\n![데이터베이스 sc cl ](/img/changelog/changelog-db.png)\\n\\n<Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> 메뉴의 UI 및 기능을 개선하였으며, 해당 메뉴에서 데이터베이스의 성능 지표 정보를 바로 확인할 수 있습니다. 또한 <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴에서 클러스터별 에이전트를 선택할 수 있습니다. 그리고 데이터베이스 로그를 검색하고 추이를 확인하고 로그 관련 알림을 받을 수 있는 <Cmdname sid=\\"side_log\\" className=\\"uitext\\" /> 메뉴를 제공합니다.\\n\\n<code class=\\"my\\">V2</code> 전환과 동시에 기존 XOS와 XOS2로 나누어져 있던 지표를 %로 확인할 수 있는 백분률 표기로 변경하고 **XOS**로 통합해 제공합니다.\\n\\n### Oracle Pro 출시 \\n\\n**Oracle Pro** 정식 서비스가 시작되었습니다. 와탭 **Oracle Pro**는 데이터베이스 서버의 메모리에 직접 접근해 성능 지표를 모니터링하며, 최대 1초에 20번까지 최신 성능 정보를 수집합니다. 디스크 I/O를 거치지 않아 시스템 부하를 최소화하고, 쿼리 실행 시간과 버퍼 캐시 상태 등의 정밀한 성능 분석을 제공합니다.\\n\\n<ImgLang img=\'db-multi-instance-oracle-pro.png\' desc=\'오라클 v2 신규 분기 예시\' />\\n\\n### 사용자 정의형 위젯 \\n\\n<Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴 개선과 함께 새롭게 사용자 정의형 위젯을 제공합니다. 대시보드에서 기본 제공되는 지표 외에 사용자가 원하는 지표를 추가할 수 있습니다.\\n\\n![사용자 정의형 위젯 분기 예시](/img/changelog/changelog-24q3-db-custom.png)\\n\\n### 애플리케이션 연계 분석 \\n\\n와탭은 ***연계 프로젝트***를 통해 애플리케이션과 데이터베이스 프로젝트 간 ***연계 분석*** 기능을 제공합니다. 데이터베이스 프로젝트 내 ***인스턴스 모니터링*** 메뉴에서 실시간으로 데이터베이스에서 활성화된 세션과 연동된 애플리케이션의 액티브 트랜잭션 정보를 조회하여 애플리케이션과 데이터베이스 간 상호작용을 살펴볼 수 있습니다. \\n\\n<ImgLang img=\'db-linked-project-instance-monitoring-postgresql.png\' desc=\'연계 분석 분기 예시\' />\\n\\nJava 프로젝트 내 ***애플리케이션 대시보드***에서는 ***연계 DB 세션*** 기능을 통해 액티브 트랜잭션과 연계된 데이터베이스의 SQL 성능을 조회할 수 있습니다. 연계 프로젝트 관리 기능은 여러 프로젝트의 데이터를 통합적으로 확인하여 문제 원인을 빠르게 파악하고 효율적으로 성능 관리를 할 수 있도록 돕습니다. \\n\\n{/* <ImgLang img=\'linked-project-management.png\' desc=\'연계 프로젝트 관리 분기 예시\' /> */}\\n\\n현재 애플리케이션과 데이터베이스 연계 분석은 **Java** 플랫폼만 지원합니다. 또한 ***연계 DB 세션*** 기능의 경우 Java 에이전트 2.3.33 버전 이상이 필요합니다. 데이터베이스 플랫폼의 경우 `PostgreSQL`, `MySQL`, `Oracle` <code class=\\"my\\">V2</code> 및 `Oracle Pro` 플랫폼이 해당 기능을 지원합니다. \\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. */}\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_1q from \\"../crw-data/crwld-service/_import-service-Database.mdx\\";\\n\\n<Database_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport DBX_agent_1q from \\"../crw-data/crwld-agent/_import-agent-dbx.mdx\\";\\n\\n<DBX_agent_1q />\\n\\n</details> */}\\n\\n:::note \\n\\n* **Oracle Pro** 상품에 대한 자세한 내용은 [다음 문서](../oracle-pro/monitoring-intro)를 참조하세요.\\n\\n* <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴의 사용자 정의 위젯에 대한 자세한 내용은 [다음 문서](../oracle/multi-instance-monitoring#customwidget)를 참조하세요. \\n\\n* **연계 분석**에 대한 자세한 내용은 [다음 문서](../oracle/linked-projects)를 참조하세요. \\n\\n* 애플리케이션 프로젝트에서 데이터베이스 프로젝트를 연계하는 방법에 대한 자세한 내용은 [다음 문서](../java/linked-projects)를 참조하세요. \\n\\n:::\\n\\n{/* :::note\\n\\n현재 애플리케이션과 데이터베이스 연계 분석은 **Java** 플랫폼만 지원합니다. 또한 연계 DB 세션 기능의 경우 Java 에이전트 2.3.33 버전 이상이 필요합니다. **연계 분석**에 대한 자세한 내용은 [다음 문서](../oracle/linked-projects)를 참조하세요. 애플리케이션 프로젝트에서 데이터베이스 프로젝트를 연계하는 방법에 대한 자세한 내용은 [다음 문서](../java/linked-projects)를 참조하세요. \\n\\n::: */}\\n\\n<br/>\\n\\n## `Browser`\\n\\n{/* 와탭 2024년 1분기 `Browser` 상품의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능 및 ***사용자 정의 이벤트 수집 기능***을 소개합니다.  */}\\n\\n### 사용자 세션 분석 \\n\\n새롭게 제공하는 <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능은 사용자의 웹 페이지 탐색 방식을 파악하고자 할 때 활용할 수 있습니다. 사용자가 어떻게 움직이고, 어떤 페이지에 머무르고 있는지, 화면의 어떤 요소를 클릭하는지, 화면에서 발생하는 에러 등에 관한 사용자의 전반적인 활동을 분석해 사용자가 서비스를 이용하는 방식에 대한 통찰을 얻는 것뿐 아니라 사용자의 행동 패턴을 이해하는 데에 더 가까워질 수 있습니다. \\n\\n<Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />을 이용해 사용자의 페이지 내 행동 분석 및 세션 중 발생하는 여러 에러 추적이 가능합니다. 세션 로그 정보를 통해 최종 사용자의 경로, 이탈 원인, 성능 및 사용자 경험 등을 분석할 수 있습니다. 또한 ***AJAX 히트맵***과 <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />에서 실시간으로 문제를 겪고 있는 사용자를 파악할 수 있습니다. 이러한 정보를 통해 사용자의 서비스 경험과 서비스의 현재 성능 상태를 확인할 수 있습니다.\\n\\n<ImgLang img=\'browser-search-user-session-log-analysis.png\' desc=\'사용자 세션 분석 분기 예시\' className=\'changelog-img\'/>\\n\\n{/* ***사용자 정의 이벤트 수집*** 기능은 브라우저 모니터링이 제공하는 기본 정보 외 사용자가 원하는 이벤트를 추가적으로 수집할 수 있는 인터페이스를 제공합니다. 브라우저 에이전트에서 제공하는 인터페이스 중 `addCustomEvent` 메소드를 이용해 사용자 정의형 이벤트를 수집 후 <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" /> 메뉴 또는 <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />를 통해 수집한 데이터를 조회할 수 있습니다.  */}\\n\\n### 세션 리플레이 \\n\\n새롭게 제공하는 <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능은 사용자가 웹 사이트에서 수행하는 모든 이벤트를 자동으로 기록하고 재생할 수 있는 기능입니다. \\n\\n사용자의 클릭, 스크롤, 입력, 페이지 전환 등과 같은 모든 이벤트를 정확하게 재현하여 웹 사이트와 사용자 사이의 상호작용을 분석할 수 있습니다. 이를 통해 실제 사용자 경험을 재현하여 잠재적인 문제를 빠르게 식별하고 해결할 수 있으며, 사용자의 웹 사이트 사용 방식에 대한 통찰을 제공하여 최적화를 도울 수 있습니다. \\n\\n![세션 리플레이 sc](/img/changelog/changelog-24q2-browser1.png)\\n\\n\\n### 페이지 로드 통계 \\n\\n새롭게 제공하는 <UI>페이지 로드 통계</UI> 기능은 웹 사이트의 페이지별 로드 성능 정보를 제공합니다. 각 페이지의 로드 과정을 추적하여 성능 저하 원인을 파악하고, 최적화된 페이지의 개선 효과를 확인할 수 있습니다. ***페이지 그룹***을 기준으로 페이지 로드 시간 및 DOM 로드 시간, 네트워크 지연 시간, 리소스 로드 시간 등 다양한 성능 지표를 제공합니다. 이를 통해 페이지 성능 최적화 여부를 확인할 수 있습니다\\n\\n<ImgLang img=\\"browser-pageload-statistics.png\\" desc=\\"페이지 로드 통계 분기 예시\\" />\\n\\n:::note \\n\\n* <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능에 대한 자세한 내용은 [다음 문서](../browser/user-session-log-search#analysisusersession)를 참조하세요. \\n\\n* <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능에 대한 자세한 내용은 [다음 문서](../browser/session-replay)를 참조하세요. \\n\\n* <UI>페이지 로드 통계</UI> 기능에 대한 자세한 내용은 [다음 문서](../browser/pageload-stat)를 참조하세요. \\n\\n:::\\n\\n\\n{/* 사용자가 웹 페이지를 탐색하는 방식을 이해할 수 있도록 돕습니다. 파악을 돕습니다.   */}\\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_1q from \\"../crw-data/crwld-service/_import-service-Browser.mdx\\";\\n\\n<Browser_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_1q from \\"../crw-data/crwld-agent/_import-agent-browser.mdx\\";\\n\\n<Browser_agent_1q />\\n\\n</details> */}\\n\\n<br/>\\n\\n## `Network`\\n\\n와탭 2024년 1분기에 네트워크 간의 혼잡 및 장애를 파악하고 사용자의 네트워크 성능 개선을 위해 프로세스의 네트워크 정보를 수집하는 **네트워크 성능 모니터링**(**Network Performance Monitoring**) 상품이 정식으로 출시되었습니다. \\n\\n![네트워크 모니터링 sc cl ](/img/changelog/changelog-network.png)\\n\\n{/* 최근 네트워크 시장은 클라우드와 가상화라는 큰 틀에서 성장하고 있습니다. 기존 장비 중심의 네트워크 모니터링 뿐만 아니라 작업을 수행하는 프로세스가 중요한 모니터링 대상이 되고 있습니다. 와탭 네트워크 성능 모니터링을 통해 프로세스 단위의 네트워크 지표를 안정적으로 모니터링해 보세요. */}\\n\\n와탭의 `Network` 상품은 각 프로세스가 수행하는 네트워크 동작을 추적해 복잡한 구성 요소와 상태 정보를 토폴로지를 통해 직관적으로 이해할 수 있도록 시각화했습니다. **품질 지표** ***Latency***와 ***Jitter***, 그리고 **네트워크 사용량 지표** ***bps***, ***pps***, ***session count***를 조회할 수 있습니다. 또한 태그 옵션으로 가시성을 확보하였으며, <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />를 통해 다양한 사용자 커스텀 차트를 제공합니다.\\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Network` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</details> */}\\n\\n:::note \\n\\n* `Network` 상품에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/introduction)를 참조하세요. \\n\\n* AWS 리소스 식별 관련한 에이전트 옵션 안내에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/set-aws-resource-options)를 확인하세요. \\n\\n:::\\n\\n<br/>\\n\\n\\n\\n## `Features`\\n\\n와탭 피쳐 프로젝트(<code class=\'Features\'>Features</code>) 방식으로 `KAFKA`, `Aerospike`,`Apache Pulsar`, `vCenter`, `NGINX`, `APACHE` 모니터링 **베타** 서비스를 시작하였습니다. 추후 정식 배포 예정이며 지원 범위 역시 확대될 예정입니다. \\n\\n![피쳐 프로젝트 분기 예시](/img/changelog/changelog-24q3-feature.png) \\n\\n{/* - <code class=\\"Beta\\">Beta</code> 피쳐 프로젝트(<code class=\'Features\'>Features</code>) <code class=\'changelog-overview2\'>Aerospike</code> <b>베타</b> 서비스 시작\\n\\n- <code class=\\"Beta\\">Beta</code> 피쳐 프로젝트(<code class=\'Features\'>Features</code>) <code class=\'changelog-overview2\'>Apache Pulsar</code> <b>베타</b> 서비스 시작 */}\\n\\n:::note \\n\\n* <code class=\\"Beta\\">Beta</code> `KAFKA` 모니터링에 대한 자세한 내용은 [다음 문서](../features/kafka-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `Aerospike` 모니터링에 대한 자세한 내용은 [다음 문서](../features/aerospike-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `Apache Pulsar` 모니터링에 대한 자세한 내용은 [다음 문서](../features/apache-pulsar-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `vCenter` 모니터링에 대한 자세한 내용은 [다음 문서](../features/vcenter-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `NGINX` 모니터링에 대한 자세한 내용은 [다음 문서](../features/nginx-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `APACHE` 모니터링에 대한 자세한 내용은 [다음 문서](../features/apache-introduction)를 참조하세요. \\n\\n:::\\n\\n\\n{/* ## `Log`\\n\\n와탭 2024년 1분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항으로 개편된 **로그 검색 필터 기능**을 소개합니다. \\n\\n<Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_logTail\\" className=\\"uitext\\" /> 메뉴 내 **로그 검색 필터 기능**이 개편되었습니다. 검색 값 입력 시 안내 가이드 UI를 통해 지원하는 검색 문법을 확인할 수 있고, 키보드 입력으로 태그를 생성 및 수정하고 연산자를 클릭해 수정할 수 있는 기능이 추가되었습니다.\\n\\n또한 에이전트 옵션이 설정된 경우 로그 레벨(<span class=\'logwr\'>WARN</span>, <span class=\'loger\'>ERROR</span>, <span class=\'logft\'>FATAL</span>)을 수집해 로그 목록 왼쪽에서 해당 기준 색상을 표시하는 기능이 추가되었습니다.  \\n\\n![로그 에이전트 옵션 cl분기 예시 ](/img/log-agent-option-level.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_1q from \\"../crw-data/crwld-service/_import-service-Log.mdx\\";\\n\\n<Log_1q />\\n\\n</details>\\n\\n<br/> */}\\n\\n\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n{/* 와탭 2024년 1분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 새로운 기능인 **컨트롤 플레인 모니터링**, <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 그리고 개편된 기능인 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" />, 아울러 새로 추가된 **Helm** 차트 설치 지원 등에 대해서 소개합니다.  */}\\n\\n### 컨트롤 플레인 모니터링 \\n\\n와탭 쿠버네티스 모니터링은 새롭게 **컨트롤 플레인 모니터링**을 제공합니다. 쿠버네티스 클러스터 전반을 관리하는 컨트롤 플레인 컴포넌트 중 클러스터 내 API 요청을 처리하는 kube-apiserver에 대한 가시성 확보를 위해 <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n\\n<Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" />는 kube-apiserver의 상태 및 성능 메트릭 수집, 응답 시간, 처리량, 요청 실패 등을 추적하여 클러스터의 가용성과 성능을 모니터링할 수 있습니다. <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />를 통해서는 kube-apiserver 수집 지표 목록을 조회할 수 있습니다.\\n\\n![컨트롤 플레인 모니터링 sc cl](/img/changelog/changelog-k8s-kube-apiserver.png)\\n\\n### Deployment 목록과 쿠버네티스 에이전트 목록\\n\\n또한 Deployment 기준으로 관련 정보를 조회할 수 있는 <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n\\n개별 Pod 보다 Pod 집합 상태를 모니터링하는 것이 서비스 안정성과 성능 확보를 위해 중요합니다. 애플리케이션 배포 및 업데이트를 담당하는 Deployment 모니터링은 그러한 의미에서 필수적입니다. <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />에서 리소스 관계도 및 클러스터 내 Pod, 컨테이너, 애플리케이션 현황 및 CPU, 메모리, 트랜잭션 수 등 주요 성능 지표를 Deployment 단위로 조회할 수 있습니다. \\n\\n또한 새롭게 추가된 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />에서는 마스터 및 노드 에이전트 설치 현황을 한 눈에 살펴볼 수 있습니다.\\n\\n### Pod 시작 분석과 오브젝트 매니페스트\\n\\n기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 각 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> 기능을 제공합니다. <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />은 Pod별 시작 시점 정밀 분석을 통해 기동에 소요되는 시간과 리소스 사용량에 대한 상세 데이터를 제공합니다. <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" />는 오브젝트별 과거 조회 및 비교 기능이 추가되어 클러스터 내 변동 사항을 쉽게 추적할 수 있습니다. \\n\\n![오브젝트 매니페스트 및 Pod 시작 분석 sc cl](/img/changelog/changelog-k8s-om-podinit.png)\\n\\n{/* \\n\\n뿐만 아니라 Deployment 기준으로 리소스 관계도 및 트레이스, 로그, 메트릭스와 같은 옵저버빌리티의 핵심 데이터를 한 눈에 확인할 수 있습니다. \\n\\n클러스터 관리 효율성 향상 */}\\n\\n아울러 마스터 및 노드 에이전트 설치 시 기존 Yaml 파일 방식 외 운영 복잡도를 덜어줄 **Helm** 차트 설치 방식을 공식적으로 지원합니다. \\n\\n### Pending Pod 현황 \\n\\n<Cmdname sid=\\"side_lab\\" className=\\"uitext\\" /> 메뉴에서 제공되던 <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 기능이 <code class=\\"my\\">V2</code>로 개편되면서 <Cmdname sid=\\"side_workload\\" className=\\"uitext\\" /> 하위 메뉴로 정식 배포되었습니다. <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 기능은 Pending 상태의 Pod에 대한 실시간 가시성을 제공함은 물론 Pending의 원인 분석을 가능하게 하는 연계 데이터를 함께 제공합니다. 이를 통해 클러스터 및 서비스의 가용성을 높일 수 있습니다.\\n\\n<ImgLang img=\'k8s-pending-pod-status-detail.png\' desc=\'Pending Pod 상세 분기 예시\' />\\n\\n### 리소스 관계 \\n\\n와탭 쿠버네티스 모니터링은 2024년 상반기 내내 지속적인 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 개선 작업을 진행하였습니다. 그 일환으로 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />에 <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능이 추가되었습니다. <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능을 사용하면 쿠버네티스 리소스 간 계층 구조 및 연결 관계를 시각적으로 확인할 수 있기에 쿠버네티스 환경 분석은 물론 문제 발생 시 원인 파악 및 영향도를 한 눈에 파악할 수 있습니다.\\n\\n<p align=\\"center\\"> \\n\\n![리소스 관계 분기 예시](/img/k8s-container-detail-rr-s.png)\\n\\n</p>\\n\\n\\n### 노드 모니터링 확장 \\n\\n와탭 쿠버네티스 모니터링은 노드 모니터링 확장과 함께 여러 가지 새로운 기능을 제공합니다. <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 보다 효율적으로 개선되었습니다.\\n\\n<Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />을 통해 클러스터 관점에서 노드 상태를 모니터링할 수 있습니다. 노드의 실시간 상태, 리소스 사용 현황 및 노드 간 관계를 직관적으로 파악할 수 있으며, 그룹화, 임계치 설정, 라벨 등의 사용자 설정을 통해 사용자가 원하는 방식으로 대시보드를 구성할 수 있습니다.\\n\\n<ImgLang img=\'k8s-node-map-custom.png\' desc=\'k8s 노드맵 분기 예시\' />\\n\\n<Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" /> 메뉴에서 시간에 따라 노드의 상태 변화를 추적할 수 있습니다. 예를 들어 특정 노드의 제거 시점 및 해당 시점의 상태를 시각적으로 파악할 수 있습니다. 이를 통해 클러스터 운영 중 발생한 이슈 분석이나 과거 상황을 확인하는 데 유용합니다. \\n\\n<ImgLang img=\'k8s-node-timeline-stage.png\' desc=\'k8s 노드 타임라인 분기 예시\' />\\n\\n<Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />을 통해 노드에 마운트된 개별 디스크의 상태를 실시간으로 모니터링할 수 있습니다. 그리고 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴의 비교 및 상세 정보 조회 기능이 개선되었습니다. <Cmdname sid=\\"side_nodeDetail\\" className=\\"uitext\\" /> 메뉴로 이동하는 대신 선택한 노드의 구성 및 리소스, 메트릭스, 이벤트 정보를 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 상세 모달을 통해 확인할 수 있습니다. \\n\\n### 구성 요소 분석 강화 \\n\\n<Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> 및 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"node\\" /> 기능이 새롭게 제공되어, 각 구성 요소의 성능과 상태를 종합적으로 분석할 수 있습니다. <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />과 <UI>노드 맵</UI>의 <Cmdname sid=\\"TTL06782\\" className=\\"uitext\\" /> 탭에서 원하는 요약 분석 정보를 확인할 수 있습니다. \\n\\n![k8s 성능 요약 분석 분기 예시](/img/changelog/changelog-24q3-k8s-summary.gif)\\n\\n### 쿠버네티스 진입부 모니터링 확장\\n\\n와탭 쿠버네티스 모니터링 정보 확대의 일환으로 <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴와 <UI>Ingess 목록</UI> 메뉴가 새롭게 추가되어, 각 서비스의 구성과 연결된 파드 상태 및 쿠버네티스 클러스터로 들어오는 외부 트래픽의 흐름까지 확인할 수 있습니다. \\n\\n<ImgLang img=\'k8s-service-list.png\' desc=\'k8s Service 목록 분기 예시\' />\\n<ImgLang img=\'k8s-ingress-list.png\' desc=\'k8s 인그레스 목록 분기 예시\' />\\n\\n{/* 다음 개요 안내를 통해 2024년 1분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_1q from \\"../crw-data/crwld-service/_import-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Kubernetes_agent_1q from \\"../crw-data/crwld-agent/_import-agent-k8s.mdx\\";\\n\\n<Kubernetes_agent_1q />\\n\\n</details> */}\\n\\n:::note \\n\\n* <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-dashboard)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-metrics-search)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/deployment-list)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/agent-list)를 참조하세요. \\n\\n* 마스터 및 노드 에이전트 *Helm* 차트 설치 방식에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/install-master-node-agent#create-kubernetes-agent)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-map)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-timeline)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-disk-list)를 참조하세요. \\n\\n* <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> 및 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능에 대한 더 자세한 내용은 [다음 문서](../kubernetes/container-map-target-info#kube-resource-summary-analysis)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/service-list)를 참조하세요. \\n\\n:::"},{"id":"overview","metadata":{"permalink":"/whatap-docs/blog/overview","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/overview.mdx","source":"@site/blog/overview.mdx","title":"서비스 개요","description":"New Feature Overview","date":"2024-11-07T15:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"서비스 개요","permalink":"/whatap-docs/blog/tags/서비스-개요"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"overview","title":"서비스 개요","authors":"ysj","date":"2024-11-07T15:30","toc_max_heading_level":2,"tags":["새로운 기능","서비스 개요"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"와탭 24년 안내","permalink":"/whatap-docs/blog/2024-summary"},"nextItem":{"title":"3분기 안내","permalink":"/whatap-docs/blog/2024-3q-summary"}},"content":"import CustomListItem from \'@site/src/components/CustomListItem\'; \\n\\nimport ChangelogComponent from \'@site/src/components/ChangelogComponent\';\\n\\n![New Feature Overview](/img/changelog/new_feature_overview_txt.png)\\n\\n와탭이 제공하는 서비스 새로운 기능 개요를 한 눈에 살펴보세요.\\n\\n{/* 와탭의 서비스 히스토리 개요를 한 눈에 살펴보세요. */}\\n\\n{/* truncate */}\\n\\n<br/>\\n<br/>\\n\\n<div class=\'history_overview\' id=\'overview_test\'>\\n\\n<CustomListItem>\\n\\n<ChangelogComponent>\\n\\nimport Overview from \\"../crw-data/overview/_changelog_overview.mdx\\";\\n\\n<Overview /> \\n\\n</ChangelogComponent>\\n\\n</CustomListItem>\\n\\n\\n</div>"},{"id":"2024-3q-summary","metadata":{"permalink":"/whatap-docs/blog/2024-3q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-3q-summary.mdx","source":"@site/blog/2024-3q-summary.mdx","title":"3분기 안내","description":"와탭의 2024년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-10-21T09:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2024","permalink":"/whatap-docs/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-3q-summary","title":"3분기 안내","authors":"ysj","date":"2024-10-21T09:30","toc_max_heading_level":2,"tags":["새로운 기능","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"서비스 개요","permalink":"/whatap-docs/blog/overview"},"nextItem":{"title":"2분기 안내","permalink":"/whatap-docs/blog/2024-2q-summary"}},"content":"와탭의 2024년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n{/* 새로운 기능 sc 이미지 국문과 영문 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n{/* > * <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 메뉴 및 <Cmdname sid=\\"side_integratedRealtimeAlert\\" className=\\"uitext\\" /> 등 경고 알림 기능이 개선되었습니다.  */}\\n> * <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다.\\n> * `Application`, `Kubernetes`, `Database` 상품군에서 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴를 새롭게 제공합니다. \\n\\n{/* 공통 메뉴 개선 또는 이벤트 v2 메뉴 개선 \\n\\n> * 편의성 향상을 위해 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴가 개선되었습니다.\\n\\n*/}\\n\\n|**Application**|\\n|---|\\n\\n> <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 등 공통 메뉴가 개선되었습니다.\\n\\n{/* > * `Node.js` 상품이 로그 모니터링을 제공합니다.\\n> * `.NET` 상품이 멀티 트랜잭션을 지원합니다. */}\\n\\n{/* > * `.NET` Core 라이브러리 지원 범위가 확대되었으며 멀티 트랜잭션을 지원합니다.  */}\\n{/* > * 애플리케이션과 데이터베이스 상품 연계 모니터링을 지원합니다. (10월) */}\\n\\n|**Server**|\\n|---|\\n\\n> * Unix **HP-UX** 설치 패키지를 제공합니다.\\n> * <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n\\n|**Kubernetes**|\\n|---|\\n\\n> * <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. \\n> * <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능을 새롭게 제공합니다. \\n> * <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n\\n{/* \\n\\n> * 쿠버네티스 노드 모니터링 확장의 일환으로 <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. \\n> * 쿠버네티스 구성 요소의 분석 기능을 강화하여 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능을 새롭게 제공합니다. \\n> * 쿠버네티스 모니터링 정보 확장의 일환으로 <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n\\n*/}\\n\\n|**Database**|\\n|---|\\n\\n> * `Oracle`, `Altibase`, `Cubrid` 상품 <code class=\\"my\\">V2</code> 서비스를 제공합니다.\\n> * `Oracla Pro` 상품 **정식** 서비스를 제공합니다. \\n> * <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. \\n> * <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴의 기능 개선이 이루어졌습니다. \\n\\n{/* > * 애플리케이션과 데이터베이스 상품 연계 모니터링을 지원합니다. (10월, 10월에 또 클라우드 지표 긁어오는 거 가능) */}\\n\\n|**Browser**|\\n|---|\\n\\n> <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능 안정화가 이루어졌습니다. \\n\\n{/* \\n\\n|**Log**|\\n|---| \\n\\n*/}\\n\\n\\n{/* \\n\\n오버뷰 추가 건들 \\n\\n- node.js: svelt 설치 가능 문서 업데이트 (완)\\n\\n- PostgreSQL: 티맥스 지원 (완)\\n\\n체인지로그 추가 건들\\n\\n- 디비 전 제품 지표 업데이트 \\n\\n*/}\\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n{/* 공통 및 브라우저 뺄지?? */}\\n\\n## `공통`\\n\\n와탭 2024년 3분기 `공통` 부분에서 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 메뉴 개선 및 새롭게 개편된 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴를 소개합니다. \\n\\n기존 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> 및 새로운 <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴에 검색 기능이 추가되었습니다. 이벤트 목록 오른쪽 상단의 검색 입력창을 통해 <Cmdname sid=\\"event_title\\" className=\\"uitext\\" />, <Cmdname sid=\\"ITM07659\\" className=\\"uitext\\" />를 기준으로 문자열을 입력하거나 <Cmdname sid=\\"event_name\\" className=\\"uitext\\" /> 또는 <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> 중 원하는 기준을 선택 후 문자열을 입력하여 이벤트를 검색할 수 있습니다. \\n\\n![공통 이벤트 검색 분기 예시](/img/changelog/changelog-24q3-common1.png)\\n\\n`Application`, `Kubernetes`, `Database` 상품군 공통으로 <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴가 새롭게 개편되었습니다. <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code>는 사용자 경험을 대폭 개선하여 모니터링 작업을 더욱 효율적으로 수행할 수 있도록 설계되었습니다. \\n\\n![공통 메트릭스 차트 v2 분기 예시](/img/changelog/changelog-24q3-common-metrics-chart.gif)\\n\\n{/* ![공통 메트릭스 차트 v2 분기 예시2](/img/changelog/changelog-24q3-common-add_chart.gif) */}\\n\\n사용자는 ***시간***, ***대상***, ***인터벌*** 설정을 한 번에 처리하고 쉽게 차트를 추가할 수 있습니다. 또한 대시보드 위젯의 시간 범위를 자유롭게 변경할 수 있으며 일괄 변경 기능과 프리셋 기능을 통해 설정 관리가 간편해졌습니다. 이와 더불어 대시보드 레이아웃과 위젯도 자유롭게 조정할 수 있어 차트 분석이 더욱 효율적으로 개선되었습니다.\\n\\n{/* \\n\\n인터페이스가 단순화되어 사용자는 시간, 대상, 인터벌 등의 설정을 한 번에 처리하고 모니터링할 지표를 쉽게 선택해 차트를 추가할 수 있습니다. 또한 대시보드 위젯을 삭제하지 않고도 차트의 시간 범위를 자유롭게 변경할 수 있어 더 유연한 모니터링이 가능해졌습니다. 일괄 변경 기능이 도입되어 대시보드의 모든 위젯에 동일한 설정을 한 번에 적용할 수 있어 일관된 관리가 용이하며, 프리셋 기능을 통해 위젯 구성을 저장하고 필요할 때 불러와 반복 작업을 줄이고 다양한 분석 시나리오를 빠르게 실행할 수 있습니다. 이와 더불어, 대시보드 레이아웃과 위젯을 사용자 맞춤형으로 자유롭게 조정할 수 있어 차트 분석이 한층 더 편리해졌습니다.\\n\\n* **사용자 경험(UX) 개선**: 시간, 대상, 인터벌 등의 옵션을 사용자가 한 번에 설정한 후, 모니터링할 지표를 쉽게 선택하고 차트를 추가할 수 있도록 인터페이스를 개선하였습니다. 이를 통해 사용자 동선이 단순해지고, 더 직관적인 차트 추가가 가능합니다.\\n\\n* **차트 조회 시간 범위 수정**: 대시보드에 배치된 위젯을 삭제하지 않고도 차트의 조회 시간 범위를 자유롭게 변경할 수 있어, 더욱 유연한 모니터링이 가능합니다.\\n\\n* **일괄 변경**: 대시보드에 배치된 모든 위젯에 동일한 옵션을 한 번에 적용할 수 있는 일괄 변경 기능을 도입하여, 일관된 설정 관리가 용이해졌습니다.\\n\\n* **프리셋**: 프리셋 기능을 통해 대시보드에 배치된 위젯의 구성을 저장하고 필요할 때 불러올 수 있습니다. 이를 통해 반복적인 작업을 최소화하고, 다양한 시나리오에 맞춘 분석을 빠르게 수행할 수 있습니다.\\n\\n* **대시보드 레이아웃 및 위젯 조정**: 다양한 옵션을 제공하여 대시보드 레이아웃과 위젯 기능을 자유롭게 조정할 수 있습니다. 이를 통해 사용자 맞춤형 대시보드 구성이 가능하며, 차트 분석을 더욱 편리하게 할 수 있습니다. \\n\\n*/}\\n\\n{/* \\n\\n\\n- 시간 대상 지표 선택 쉬워짐 \\n\\n- 대상 선택은 직관적인 트리 목록뷰 및 복수 선택 \\n\\n- 분석 시 유용한 지표 한눈에 \\n\\n- 차트 레이아웃 변경\\n\\n- 프리셋 및 일괄 적용 기능 \\n\\n**기존 메트릭스 차트 메뉴와의 차이점**\\n\\n- 사용자가 시간, 대상, 인터벌 옵션을 설정한 다음 모니터링하려는 대상의 지표를 특정하고 차트를 추가할 수 있도록 사용자 경험(UX)을 개선했습니다.\\n\\n- 대시보드에 배치한 위젯을 삭제하지 않고 차트 조회 시간 범위를 변경할 수 있습니다.\\n\\n- 대시보드에 배치한 모든 위젯의 옵션을 일괄로 적용할 수 있는 일괄 변경 기능을 제공합니다.\\n\\n- 프리셋 기능을 통해 대시보드에 배치한 위젯의 정보를 저장하고 불러올 수 있습니다.\\n\\n- 제공하는 다양한 옵션을 통해 대시보드의 레이아웃 및 위젯의 기능을 조정할 수 있습니다. \\n\\n*/}\\n\\n다음 개요 안내를 통해 2024년 3분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Common.mdx\\";\\n\\n<Common_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n<Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 메뉴에 대한 자세한 내용은 [다음 문서](../java/metrics-chart-v2)를 참조하세요.\\n\\n:::\\n\\n<br/>\\n\\n## `Application`\\n\\n와탭 2024년 3분기 `Application` 부분의 주목할 만한 신규 기능 및 주요 변경 사항으로 공통 기능 개선 사항을 안내합니다. \\n\\n와탭 애플리케이션 모니터링은 이번 3분기에 <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> 메뉴에 특정 IP별로 호출한 URL 및 호출 건수를 조회할 수 있는 <Cmdname sid=\\"side_statIp\\" className=\\"uitext\\" /> 메뉴를 제공합니다. 또한 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴 하위의 <Cmdname sid=\\"side_threadList\\" className=\\"uitext\\" /> 메뉴에 선택한 에이전트가 설치된 애플리케이션의 스레드 현황 조회 기능 및 CPU 증가량 컬럼이 추가되었습니다. \\n\\n![애플리케이션 분기 예시](/img/changelog/chagnelog-24q3-application.png)\\n\\n다음 개요 안내를 통해 2024년 3분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Application.mdx\\";\\n\\n<Application_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-java.mdx\\";\\n\\n<Java_agent_24q3 />\\n\\n<br/>\\n### `PHP`\\n\\nimport PHP_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-php.mdx\\";\\n\\n<PHP_agent_24q3 />\\n\\n<br/>\\n### `Node.js`\\n\\nimport Nodejs_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-nodejs.mdx\\";\\n\\n<Nodejs_agent_24q3 />\\n\\n<br/>\\n### `Python`\\n\\nimport Python_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-python.mdx\\";\\n\\n<Python_agent_24q3 />\\n\\n<br/>\\n### `.NET`\\n\\nimport DOTNET_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-dotnet.mdx\\";\\n\\n<DOTNET_agent_24q3 />\\n\\n<br/>\\n### `Go`\\n\\nimport Go_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-golang.mdx\\";\\n\\n<Go_agent_24q3 />\\n\\n</details>\\n\\n:::info\\n\\n* `Node.js` 상품이 로그 모니터링을 제공합니다.\\n\\n* `.NET` 상품이 멀티 트랜잭션을 지원합니다.\\n\\n:::\\n\\n:::note \\n\\n* <Cmdname sid=\\"side_statIp\\" className=\\"uitext\\" /> 메뉴에 대한 자세한 설명은 [다음 문서](../java/analysis-apm-trs#statiptx)를 참조하세요.\\n\\n* <Cmdname sid=\\"side_threadList\\" className=\\"uitext\\" /> 메뉴에 대한 활용 안내는 [다음 문서](../best-practice-guides/about-instance-performance-analysis#advanced-use-thread-list-dump)를 참조하세요.\\n\\n:::\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2024년 3분기 `Server` 부분의 주목할 만한 신규 기능으로 **Unix** `HP-UX` 설치 패키지 제공과 새로운 <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴에 대해 소개합니다. \\n\\n와탭 서버 모니터링은 이번 3분기에 새롭게 <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴를 제공합니다. <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" />는 서버의 물리적 특성 및 가상적 특성, 운영 환경 등을 체계적으로 관리하기 위한 기능입니다. 자동으로 수집된 서버 구성 요소와 사용자 정의 항목을 통해 서버의 구성을 상세하게 파악하고 관리하는 것이 가능합니다. \\n\\n![서버 구성 요소 sc](/img/changelog/changelog-24q3-server-inventory.png)\\n\\n사용자 정의 항목을 통해 커스텀 컬럼을 구성하여 서버 상태 및 성능을 더욱 세밀하게 모니터링하고 이슈 상황에 대응할 수 있습니다. 예를 들어 각 서버 담당자와 직접적인 소통이 용이하도록 운영 담당자 정보를 추가하여 문제 시 빠른 대응이 가능합니다. 또한 <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴는 3단계의 다중 정렬을 통해 조건에 맞는 서버를 빠르게 필터링 할 수 있습니다. 기본 정렬은 ***OS 타입***, ***모델***, 그리고 ***시리얼 정보*** 기준입니다. \\n\\n{/* \\n\\n서버 구성 정보 활용 예시 요약1:\\n\\n\\t•\\t라이선스 산정: 서버의 CPU, X86 socket, 물리 및 logical core 정보 등을 자동 수집하여 라이선스 비용 산정을 빠르게 처리할 수 있습니다.\\n\\t•\\tH/W 장애 대응: 장애 발생 시, 와탭 서버 구성정보를 활용해 관련 서버와 담당자 정보를 신속히 확인하고 파트 교체 작업을 효율적으로 진행할 수 있습니다.\\n\\t•\\t필터링 지원: 자동 수집된 서버 데이터를 바탕으로 특정 IP 대역의 서버를 필터링하여, 작업 시간에 대비한 사전 준비를 손쉽게 할 수 있습니다.\\n\\t•\\t커뮤니케이션 지원: 사용자 정의 컬럼을 통해 서버와 서비스를 연결, 인프라와 현업 간의 의사소통을 원활하게 할 수 있습니다.\\n\\n서버 구성 정보 활용 예시 요약2: \\n\\n\\t•\\t서버 상태 확인: 운영 중인 물리적 및 가상 서버의 현재 상태를 빠르게 파악할 수 있습니다. 예를 들어, 서버별 OS 버전이나 펌웨어 상태를 한눈에 볼 수 있어 업그레이드나 패치가 필요한 서버를 즉시 확인할 수 있습니다.\\n\\t•\\t운영 담당자 관리: 대시보드에 커스텀 항목으로 운영 담당자 정보를 추가하면, 각 서버의 담당자와 직접적인 소통이 가능하여 문제 발생 시 빠른 대응이 가능합니다.\\n\\t•\\t장비 교체 및 관리: 모델 번호와 시리얼 번호를 기준으로 특정 장비의 교체 주기나 보증 기간 등을 관리할 수 있습니다.\\n\\n서버 구성 정보 대시보드는 서버의 중요한 데이터를 효율적으로 관리하고, 필요한 정보에 신속하게 접근할 수 있도록 돕는 핵심 기능입니다. 사용자는 이를 통해 서버 자산을 체계적으로 관리하고, 운영 효율성을 크게 향상시킬 수 있습니다.\\n\\n서버 구성 정보 활용 예시: \\n\\n1.\\t라이선스 산정 요청에 대한 신속한 응답 처리\\n\\t•\\tS/W 라이선스를 도입할 때, 각 서버의 CPU 정보를 확인해야 하는 상황이 발생할 수 있습니다. 예를 들어, X86 소켓 개수, 물리 코어 개수, 또는 논리 코어 개수를 요구할 때가 있습니다.\\n\\t•\\t서버 구성정보가 자동으로 수집되고 최신 상태를 유지하면, 인프라 운영자는 해당 정보를 빠르게 필터링해 CSV 파일로 다운로드하여 요청자에게 제공할 수 있습니다.\\n\\t•\\t이를 통해 서버에 일일이 로그인해 수작업으로 데이터를 수집하는 번거로운 과정을 생략할 수 있으며, 업무 효율성을 크게 향상시킬 수 있습니다.\\n\\n2.\\tH/W 장애 대응\\n\\t•\\t예를 들어 F/C Adapter(파이버 채널 어댑터) 장애가 발생하여 교체가 필요한 상황에서, 여러 개의 OS가 설치된 하드웨어의 정보를 정확하게 파악해야 합니다.\\n\\t•\\t와탭의 서버 구성정보를 통해 해당 하드웨어의 시리얼 번호 및 설치된 OS 목록, 담당자 정보를 미리 파악할 수 있습니다.\\n\\t•\\t사용자 정의 컬럼을 사용하여 OS별 담당자나 물리적 위치 등의 추가 정보를 관리함으로써, 해당 정보를 기반으로 신속하게 작업 일정을 잡고 파트 교체 작업을 진행할 수 있습니다.\\n\\n3.\\t다양한 필터를 통한 작업 지원\\n\\t•\\t네트워크 스위치 교체 작업 시, 서비스에 영향을 줄 수 있는 서버들을 필터링하여 담당자들에게 작업 시간 동안 대기 요청을 할 필요가 있습니다.\\n\\t•\\t와탭을 통해 서버의 IP 목록을 자동으로 수집하고, 특정 IP 대역을 사용하는 서버들만 필터링하여 필요한 정보를 신속하게 파악할 수 있습니다.\\n\\n4.\\t인프라와 현업(서비스) 간의 커뮤니케이션 개선\\n\\t•\\t인프라 운영자는 서버 이름을, 현업 담당자는 서비스 이름을 기준으로 작업하는 경우가 많아, 장애 발생 시 의사소통에 어려움이 생길 수 있습니다.\\n\\t•\\t이를 해결하기 위해 사용자 정의 컬럼을 활용해 서버와 관련된 서비스를 연결하는 서비스 토폴로지 맵을 구성할 수 있습니다. 이를 통해 인프라 담당자와 현업 담당자가 효율적으로 소통하고, 장애 대응 속도를 높일 수 있습니다.\\n\\n결론적으로, 서버 구성정보의 자동화와 현행화는 업무 효율성을 크게 높이고, 다양한 상황에서 신속한 대응과 협업을 가능하게 합니다.\\n\\n서버 구성 정보 다중 정렬 기본 예시: \\n\\t•\\tOS 타입으로 정렬하면 운영 체제별 서버 상태를 한눈에 확인할 수 있어, 특정 OS에 대한 패치나 관리 작업이 필요한 경우 유용합니다.\\n\\t•\\t모델 기준 정렬은 서버 하드웨어의 종류나 스펙에 따라 자원을 최적화하고, 특정 모델에서 발생하는 문제를 분석하는 데 도움이 됩니다.\\n\\t•\\t시리얼 정보는 개별 서버를 고유하게 식별할 수 있어, 특히 대규모 환경에서 특정 서버를 신속하게 찾아야 할 때 편리합니다.\\n\\n*/}\\n\\n**Unix** `HP-UX` 에이전트 설치 패키지를 제공합니다. `HP-UX`는 Hewlett-Packard(HP)에서 개발한 고성능 Unix 운영 체제로, Itanium 및 PA-RISC 시스템에서의 안정성과 성능으로 잘 알려져 있습니다. \\n\\n![서버 모니터링 설치 페이지 sc](/img/changelog/changelog-24q3-server-hp-ux.png)\\n\\n와탭은 `HP-UX` Itanium 버전 11.23과 PA-RISC-UX 버전 11.23을 지원합니다. `HP-UX` 설치 패키지는 간단한 다운로드 및 실행만으로 쉽게 설치할 수 있으며, 와탭 서버 모니터링을 통해 `HP-UX` 운영 체제를 효과적으로 관리하고 모니터링할 수 있습니다.\\n\\n다음 개요 안내를 통해 2024년 3분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Server.mdx\\";\\n\\n<Server_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-server.mdx\\";\\n\\n<Server_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n<Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> 메뉴에 대한 자세한 내용은 [다음 문서]( ../server/server-inventory)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2024년 3분기 `Kubernetes` 부분의 주목할 만한 신규 기능 및 변경 사항으로 새로운 <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능을 소개합니다. \\n\\n와탭 쿠버네티스 모니터링은 이번 3분기에 노드 모니터링 확장과 함께 여러 가지 새로운 기능을 제공합니다. <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 보다 효율적으로 개선되었습니다.\\n\\n<Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />을 통해 클러스터 관점에서 노드 상태를 모니터링할 수 있습니다. 노드의 실시간 상태, 리소스 사용 현황 및 노드 간 관계를 직관적으로 파악할 수 있으며, 그룹화, 임계치 설정, 라벨 등의 사용자 설정을 통해 사용자가 원하는 방식으로 대시보드를 구성할 수 있습니다.\\n\\n<ImgLang img=\'k8s-node-map-custom.png\' desc=\'k8s 노드맵 분기 예시\' />\\n\\n<Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" /> 메뉴에서 시간에 따라 노드의 상태 변화를 추적할 수 있습니다. 예를 들어 특정 노드의 제거 시점 및 해당 시점의 상태를 시각적으로 파악할 수 있습니다. 이를 통해 클러스터 운영 중 발생한 이슈 분석이나 과거 상황을 확인하는 데 유용합니다. \\n\\n{/* \\n\\n시간의 흐름에 따른 노드의 상태 및 노드별 리소스 사용 패턴을 \\n\\n노드 상태 변화를 확인하고, 원하는 기간을 설정하여 상세한 상태 정보를 조회할 수 있습니다.  */}\\n\\n<ImgLang img=\'k8s-node-timeline-stage.png\' desc=\'k8s 노드 타임라인 분기 예시\' />\\n\\n<Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />을 통해 노드에 마운트된 개별 디스크의 상태를 실시간으로 모니터링할 수 있습니다. 그리고 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴의 비교 및 상세 정보 조회 기능이 개선되었습니다. <Cmdname sid=\\"side_nodeDetail\\" className=\\"uitext\\" /> 메뉴로 이동하는 대신 선택한 노드의 구성 및 리소스, 메트릭스, 이벤트 정보를 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 상세 모달을 통해 확인할 수 있습니다. \\n\\n또한 와탭 쿠버네티스 구성 요소 분석 기능이 강화되었습니다. <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> 및 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능이 새롭게 제공되어, 각 구성 요소의 성능과 상태를 종합적으로 분석할 수 있습니다. <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />의 <Cmdname sid=\\"TTL06782\\" className=\\"uitext\\" /> 탭에서 원하는 요약 분석 정보를 확인할 수 있습니다. \\n\\n![k8s 성능 요약 분석 분기 예시](/img/changelog/changelog-24q3-k8s-summary.gif)\\n\\n{/* - 컨테이너 맵 -> 대상 정보 탭 -> 컨테이너 요약 분석, 파드 요약 분석\\n\\n- 파드 목록 -> 파드 상세 -> 파드 요약 분석 */}\\n\\n더불어 와탭 쿠버네티스 모니터링 정보 확대의 일환으로 <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴가 새롭게 추가되어, 각 서비스의 구성과 연결된 파드 상태를 확인할 수 있습니다. 조회 시간 기준 최근 1분간 수집된 서비스 정보를 제공합니다. \\n{/* \\n서비스 레벨에서의 모니터링 및 분석을 한층 강화할 수 있습니다. */}\\n\\n<ImgLang img=\'k8s-service-list.png\' desc=\'k8s Service 목록 분기 예시\' />\\n\\n{/* 쿠버네티스 노드 모니터링 확장의 일환으로 <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />과 같은 신규 메뉴가 추가되었으며, 기존 <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. \\n\\n쿠버네티스 구성 요소의 분석 기능을 강화하여 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능을 새롭게 제공합니다. \\n\\n쿠버네티스 모니터링 정보 확장의 일환으로 <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. */}\\n\\n\\n{/* 이번 3분기 Kubernetes 제품의 업데이트에서는 노드 모니터링 확장과 함께 여러 가지 새로운 기능과 메뉴가 도입되었습니다. 특히, 노드 맵, 노드 타임라인, 노드 디스크 목록과 같은 신규 메뉴가 추가되었으며, 노드 목록 메뉴가 더욱 직관적이고 효율적으로 개선되었습니다.\\n\\n또한, Kubernetes 구성 요소 분석 기능이 대폭 강화되었습니다. 이를 통해 컨테이너 요약 분석 및 Pod 요약 분석 기능이 새롭게 제공되어, 각 구성 요소의 성능과 상태를 더욱 상세하고 종합적으로 분석할 수 있게 되었습니다.\\n\\n더불어, Kubernetes 모니터링 정보 확장의 일환으로 Service 목록 메뉴가 추가되어, 서비스 레벨에서의 모니터링 및 분석을 한층 강화할 수 있습니다. */}\\n\\n\\n다음 개요 안내를 통해 2024년 3분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Kubernetes_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-k8s.mdx\\";\\n\\n<Kubernetes_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n* <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-map)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-timeline)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/node-disk-list)를 참조하세요. \\n\\n* <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> 및 <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> 기능에 대한 더 자세한 내용은 [다음 문서](../kubernetes/container-map-target-info#kube-resource-summary-analysis)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> 메뉴에 대한 더 자세한 내용은 [다음 문서](../kubernetes/service-list)를 참조하세요. \\n\\n:::\\n\\n\\n<br/>\\n\\n## `Database`\\n\\n와탭 2024년 3분기 `Database` 부분에서 주목할 만한 신규 기능 및 변경 사항으로 **Oracle Pro** 정식 출시와 **Oracle**, **Altibase**, **Cubrid** 상품 <code class=\\"my\\">V2</code> 출시 및 새로운 <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> 메뉴 추가, <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴의 기능 개선에 대하여 소개합니다.\\n\\n와탭 데이베이스 상품군이 <code class=\\"my\\">V2</code>로 전환되고 있습니다. 1분기 **Redis**와 **MongoDB**에 뒤이어 3분기에는 **Oracle**, **Altibase**, **Cubrid** <code class=\\"my\\">V2</code> 서비스가 시작되었습니다. <code class=\\"my\\">V2</code>는 데이터 전송팩의 구조가 변경되었으며 UI 역시 전반적으로 개선되었습니다. \\n\\n![오라클 신규 분기 예시](/img/changelog/changelog-24q2-db.png) \\n\\n**Oracle Pro** 정식 서비스가 시작되었습니다. 와탭 **Oracle Pro**는 데이터베이스 서버의 메모리에 직접 접근해 성능 지표를 모니터링하며, 최대 1초에 20번까지 최신 성능 정보를 수집합니다. 디스크 I/O를 거치지 않아 시스템 부하를 최소화하고, 쿼리 실행 시간과 버퍼 캐시 상태 등의 정밀한 성능 분석을 제공합니다.\\n\\n<ImgLang img=\'db-multi-instance-oracle-pro.png\' desc=\'오라클 v2 신규 분기 예시\' />\\n\\n그리고 <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" />에서 새로운 <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> 기능을 제공합니다. <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" />는 SQL 스크립트를 관리할 수 있도록 도와줍니다. 사용자는 에이전트 설치 경로에 스크립트를 저장하고, 이를 모니터링 서비스에서 실시간으로 불러와 실행할 수 있습니다. 이를 통해 복잡한 데이터베이스 작업을 자동화하고 손쉽게 모니터링할 수 있습니다.\\n\\n![스크립트 매니저 분기 예시](/img/changelog/changelog-24q3-db-scm.png)\\n\\n또한 <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴 개선과 함께 새롭게 사용자 정의형 위젯을 제공합니다. 대시보드에서 기본 제공되는 지표 외에 사용자가 원하는 지표를 추가할 수 있습니다.\\n\\n![사용자 정의형 위젯 분기 예시](/img/changelog/changelog-24q3-db-custom.png)\\n\\n다음 개요 안내를 통해 2024년 3분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Database.mdx\\";\\n\\n<Database_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `DBX`\\n\\nimport DBX_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-dbx.mdx\\";\\n\\n<DBX_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n* **Oracle Pro** 상품에 대한 자세한 내용은 [다음 문서](../oracle-pro/monitoring-intro)를 참조하세요.\\n\\n* **Oracle** <code className=\\"my\\">V2</code>의 새로운 기능에 대한 자세한 내용은 [다음 문서](../oracle/monitoring-intro#new-feature)를 참조하세요.\\n\\n* **Altibase** <code className=\\"my\\">V2</code>의 새로운 기능에 대한 자세한 내용은 [다음 문서](../altibase/monitoring-intro#new-feature)를 참조하세요.\\n\\n* **CUBRID** <code className=\\"my\\">V2</code>의 새로운 기능에 대한 자세한 내용은 [다음 문서](../cubrid/monitoring-intro#new-feature)를 참조하세요.\\n\\n* <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> 기능에 대한 자세한 내용은 [다음 문서](../reference/script-manager)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴의 사용자 정의 위젯에 대한 자세한 내용은 [다음 문서](../oracle/multi-instance-monitoring#customwidget)를 참조하세요. \\n\\n:::\\n\\n{/* <br/>\\n\\n## `Browser`\\n\\n와탭 2024년 3분기 `Browser` 부분의 주목할 만한 신규 기능으로 <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" />를 소개합니다. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Browser.mdx\\";\\n\\n<Browser_24q3 />\\n\\n</details>  */}\\n\\n{/* <details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-browser.mdx\\";\\n\\n<Browser_agent_24q3 />\\n\\n</details> */}\\n\\n\\n{/* \\n\\n## `Cloud`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Cloud.mdx\\";\\n\\n<Cloud_24q3 />\\n\\n</details> \\n\\n<br/> \\n\\n*/}\\n\\n\\n<br/> \\n## `Feature`\\n\\n와탭 2024년 3분기에 피쳐 프로젝트(<code class=\'Features\'>Features</code>) 방식으로 `Aerospike` 모니터링과 `Apache Pulsar` 모니터링 **베타** 서비스를 시작하였습니다. 추후 정식 배포 예정이며 지원 범위 역시 확대될 예정입니다. \\n\\n![피쳐 프로젝트 분기 예시](/img/changelog/changelog-24q3-feature.png) \\n\\n{/* - <code class=\\"Beta\\">Beta</code> 피쳐 프로젝트(<code class=\'Features\'>Features</code>) <code class=\'changelog-overview2\'>Aerospike</code> <b>베타</b> 서비스 시작\\n\\n- <code class=\\"Beta\\">Beta</code> 피쳐 프로젝트(<code class=\'Features\'>Features</code>) <code class=\'changelog-overview2\'>Apache Pulsar</code> <b>베타</b> 서비스 시작 */}\\n\\n:::note \\n\\n* <code class=\\"Beta\\">Beta</code> `Aerospike` 모니터링에 대한 자세한 내용은 [다음 문서](../features/aerospike-introduction)를 참조하세요. \\n\\n* <code class=\\"Beta\\">Beta</code> `Apache Pulsar` 모니터링에 대한 자세한 내용은 [다음 문서](../features/apache-pulsar-introduction)를 참조하세요. \\n\\n:::\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Feature_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Feature.mdx\\";\\n\\n<Feature_24q3 />\\n\\n</details>  */}\\n\\n<br/> \\n\\n\\n{/* <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_6_x\\"><code class=\'changelog-service\'>Service 2.6.0​</code></a></code> */}\\n\\n{/* \\n\\n## `URL`\\n\\n와탭 2024년 3분기 `URL` 부분의 변경 사항을 소개합니다. \\n\\n다음 개요 안내를 통해 2024년 3분기 `URL` 상품의 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport URL_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-URL.mdx\\";\\n\\n<URL_24q3 />\\n\\n</details>\\n\\n\\n<br/> \\n\\n*/}\\n\\n\\n{/* \\n## `Log`\\n\\n와탭 2024년 3분기 `Log` 부분의 주목할 만한 신규 기능으로 ~을 소개합니다.\\n\\n* 로그 테이블 조절 컬럼 조절 및 컬럼 설정 기능 변경 \\n\\n(10월에는 로그 필터 검색 조건 즐겨찾기 기능 추가)\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Log.mdx\\";\\n\\n<Log_24q3 />\\n\\n\\n</details>  \\n\\n*/}"},{"id":"2024-2q-summary","metadata":{"permalink":"/whatap-docs/blog/2024-2q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-2q-summary.mdx","source":"@site/blog/2024-2q-summary.mdx","title":"2분기 안내","description":"와탭의 2024년 2분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-07-09T09:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2024","permalink":"/whatap-docs/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-2q-summary","title":"2분기 안내","authors":"ysj","date":"2024-07-09T09:30","toc_max_heading_level":2,"tags":["새로운 기능","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"3분기 안내","permalink":"/whatap-docs/blog/2024-3q-summary"},"nextItem":{"title":"1분기 안내","permalink":"/whatap-docs/blog/2024-1q-summary"}},"content":"와탭의 2024년 2분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n{/* 새로운 기능 sc 이미지 국문과 영문 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> 편의성 향상을 위해 공통 메뉴 개선이 이루어졌습니다. \\n\\n|**Application**|\\n|---|\\n\\n> * <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />이 지난 1분기에 이어 고도화되었습니다. \\n> * <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />에 기본 프리셋 변경 기능이 추가되었습니다.\\n\\n|**Server**|\\n|---|\\n\\n> * 서버 프로젝트 생성 시 OS를 먼저 선택할 수 있도록 설치 화면이 개편되었습니다.\\n> * Unix **Oracle Solaris** 설치 패키지를 제공합니다. \\n\\n|**Kubernetes**|\\n|---|\\n\\n> * <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> 화면이 보다 손쉬운 옵션 선택 방식으로 개편되었습니다.\\n> * <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 메뉴가 새롭게 개편되었습니다. \\n> * <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 메뉴에서 ***리소스 관계도***를 제공합니다. \\n\\n|**Database**|\\n|---|\\n\\n> **Oracle Pro** 베타 서비스를 제공합니다.  \\n\\n|**Browser**|\\n|---|\\n\\n> <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능을 새롭게 제공합니다. \\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n{/* 공통 및 브라우저 뺄지?? */}\\n\\n## `공통`\\n\\n와탭 2024년 2분기 `공통` 부분에서 편의성 향상을 위해 <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />를 비롯한 공통 메뉴 개선 작업이 이루어졌습니다. 사이드 메뉴의 <Cmdname sid=\\"side_projectList\\" className=\\"uitext\\" />에서 쉽게 그룹을 이동할 수 있으며, <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />의 경우 그룹 내 옵션을 공유할 수 있는 ***그룹 내 전체 위젯 적용*** 기능, 그룹 위젯 내 <Cmdname sid=\\"TLT06410\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n\\n![공통 분기 예시](/img/changelog/changelog-24q2-common.png)\\n\\n다음 개요 안내를 통해 2024년 2분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Common.mdx\\";\\n\\n<Common_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Application`\\n\\n와탭 2024년 2분기 `Application` 부분의 주목할 만한 신규 기능으로 지난 1분기에 이어 <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />의 고도화와 <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> 기본 프리셋 변경 기능을 소개합니다.\\n\\n<Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 고도화 작업의 일환으로 응답 시간 분포도 차트에서 선택한 항목만을 조회할 수 있는 커스텀 필터 기능을 새롭게 제공합니다. 기존 ***TOP 30*** 섹션 옆의 <Cmdname sid=\\"custom\\" className=\\"uitext\\" /> 탭에서 조회를 원하는 특정 트랜잭션, 도메인, IP 항목에서 원하는 값을 직접 입력하거나 ***TOP 30*** 목록에서 제공하는 항목을 선택하세요. 선택한 항목들의 응답 시간 분포도가 차트에 실시간으로 필터링됩니다. \\n\\n<p align=\\"center\\"> \\n\\n![트랜잭션 맵 커스텀 필터 분기 예시](/img/changelog/changelog-24q2-app-trs-map.gif)\\n\\n</p>\\n\\n<Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> 메뉴로 처음 진입했을 때 조회할 수 있는 대시보드 기본 프리셋을 변경할 수 있습니다. 선호하는 대시보드 구성을 기본 프리셋으로 설정함으로써 보다 개인화된 사용자 경험을 제공합니다. 위젯 선택과 배치를 원하는대로 수정 후 대시보드 오른쪽 위에 있는 프리셋 선택 상자에서 <Cmdname sid=\\"BTN08106\\" className=\\"uitext\\" /> 옵션을 활용해 보세요. 기본으로 지정한 대시보드는 프리셋 목록에서 <code class=\'default-tag\'>기본</code> 태그가 표시됩니다. \\n\\n![애플리케이션 대시보드 기본 프리셋 분기 예시](/img/changelog/changelog-24q2-app-preset.png)\\n\\n{/* 이를 통해 클라우드 및 컨테이너 기반 애플리케이션을 포함한 다양한 플랫폼과 환경에서의 모니터링이 가능해졌습니다. <- 아직 안됨. 로드맵엔 있음  */}\\n\\n{/* `.NET` 상품의 지원 범위가 윈도우 운영체제에서 실행되는 `.NET` 프레임워크만이 아니라 `.NET` 코어까지 확대되어 보다 다양한 운영체제 기반 모니터링을 제공합니다. 이로써 클라우드 및 컨테이너 기반 애플리케이션을 포함한 다양한 환경에서의 모니터링을 가능하게 하여 개발 및 운영 효율성을 향상하고자 하였습니다.  */}\\n\\n{/* * 닷넷 프레임워크에서 닷넷 코어(2분기 모니터링 지원 범위 확대) */}\\n\\n다음 개요 안내를 통해 2024년 2분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Application.mdx\\";\\n\\n<Application_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-java.mdx\\";\\n\\n<Java_agent_24q2 />\\n\\n### `PHP`\\n\\nimport PHP_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-php.mdx\\";\\n\\n<PHP_agent_24q2 />\\n\\n### `Node.js`\\n\\nimport Nodejs_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-nodejs.mdx\\";\\n\\n<Nodejs_agent_24q2 />\\n\\n### `.NET`\\n\\nimport DOTNET_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-dotnet.mdx\\";\\n\\n<DOTNET_agent_24q2 />\\n\\n### `Go`\\n\\nimport Go_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-golang.mdx\\";\\n\\n<Go_agent_24q2 />\\n\\n</details>\\n\\n:::info\\n\\n**구버전 애플리케이션 대시보드 서비스 종료**\\n\\n***사이트 맵***에서 진입하는 구버전 <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> <code class=\'oldfunc\'>Old</code> 메뉴가 3분기 **7월 24일**자로 서비스 제공이 **종료**될 예정입니다. <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> 메뉴에서 개선된 기능과 함께 새로운 <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />를 이용해 주세요. \\n\\n:::\\n\\n:::note \\n\\n* 애플리케이션 `.NET` 상품의 지원 범위가 기존 `.NET` Framework뿐만 아니라 `.NET` Core까지 확대되었습니다. \\n\\n* <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 메뉴의 **커스텀 필터** 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/dashboard-transactionmap#custom)를 참조하세요. \\n\\n* <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> 기본 프리셋 변경에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/dashboard#changepreset)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2024년 2분기 `Server` 부분의 주목할 만한 신규 기능으로 설치 화면 개선 및 **Unix** `Solaris` 설치 패키지에 대해 소개합니다. \\n\\n서버 모니터링 상품 설치 과정이 보다 직관적인 방식으로 개선되었습니다. 기존의 운영 체제별 탭 분리 방식 대신 사용자가 운영 체제를 먼저 선택 후 해당 OS에 맞는 개별 설치 페이지로 이동합니다. \\n\\n![서버 모니터링 설치 페이지 sc](/img/changelog/changelog-24q2-server.png)\\n\\n이번 2분기에 새롭게 **Unix** `Solaris` **에이전트 설치 패키지**를 제공합니다. 선 마이크로시스템즈가 개발한 Solaris는 고성능 Unix 운영 체제로, SPARC 시스템에서의 확장성과 ZFS 파일 시스템, DTrace와 같은 기능으로 널리 알려져 있습니다. 와탭은 Oracle Solaris 버전 11.2 이상을 지원합니다. `Solaris` 설치 패키지를 통해 해당 패키지를 다운로드 받은 후 실행하는 것만으로 간단하게 설치할 수 있습니다. 와탭 서버 모니터링을 통해 `Solaris` 운영 체제를 보다 효과적으로 관리하고 모니터링할 수 있습니다.\\n\\n{/* 서버 모니터링 상품 설치 시 사용자가 운영 체제를 먼저 선택하여 보다 직관적인 방식으로 설치 과정이 진행되도록 <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> 화면이 개선되었습니다. 기존의 OS별 탭 분리 방식 대신 운영 체제 선택 후 해당 OS에 적합한 개별 설치 페이지로 이동합니다.  */}\\n\\n{/* * 에이전트 설치 화면 편의성 개선 > OS 선택\\n\\n* Oracle Solaris 설치 패키지 제공 */}\\n\\n다음 개요 안내를 통해 2024년 2분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Server.mdx\\";\\n\\n<Server_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-server.mdx\\";\\n\\n<Server_agent_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2024년 2분기 `Kubernetes` 부분의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 개편, <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 내 <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능을 소개합니다.\\n\\n{/* 쿠버네티스 플랫폼의 다양성과 런타임 및 기능의 확장에 따라 에이전트 설치 과정의 상세도 역시 높아졌습니다. 이를 해결하기 위해 지난 1분기 *Helm* 차트 설치 지원에 이어 이번 2분기에 사용자 환경과 다양한 와탭 옵션별로 설치 *YAML* 파일 자동 생성 기능을 도입하였습니다. UI에서 원하는 옵션을 선택하여 손쉽게 설치 파일을 생성하는 방식으로 에이전트 설치 과정이 간편해지고 사용성이 크게 개선되었습니다.  */}\\n\\n쿠버네티스 제품에 발생하는 지속적인 변화와 다양한 컨테이너 런타임의 등장에 따라 에이전트 설치 과정 또한 복잡해지고 있습니다. 이에 와탭은 지난 1분기의 *Helm* 차트 설치 지원에 이어 2분기에는 새로운 쿠버네티스 <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> 기능을 제공합니다. 기존에는 설치 *YAML* 파일 다운로드 후 추가적으로 항목을 수정해야 하는 경우가 있었습니다. 하지만 이제는 UI 상에서 사용자 쿠버네티스 환경의 주요 구성요소나 특징, 그리고 사용하고자 하는 기능 선택 시 그에 적합한 설치 파일이 제공됩니다. 따라서 훨씬 더 빠르고 쉽게 에이전트를 설치할 수 있습니다.\\n\\n<ImgLang img=\'k8s-install-master-node-download.png\' desc=\'설치 파일 다운로드 분기 예시\' />\\n\\n{/* <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" />에서 제공하던 <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 메뉴가 V2로 개편되며 <Cmdname sid=\\"side_workload\\" className=\\"uitext\\" /> 하위 메뉴로 재구성되었습니다. 기존의 1회성 Pending 정보 제공에서 다음과 같이 기능이 크게 개선되었습니다. <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> V2는 Pending 상태의 Pod에 대한 실시간 가시성과 원인 분석을 가능하게 하는 연계 데이터를 함께 제공합니다. 이를 통해 클러스터 내의 Pending 상태 Pod를 체계적으로 모니터링하고 분석할 수 있습니다.  */}\\n\\n<Cmdname sid=\\"side_lab\\" className=\\"uitext\\" /> 메뉴에서 제공되던 <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 기능이 <code class=\\"my\\">V2</code>로 개편되면서 <Cmdname sid=\\"side_workload\\" className=\\"uitext\\" /> 하위 메뉴로 정식 배포되었습니다. <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> 기능은 Pending 상태의 Pod에 대한 실시간 가시성을 제공함은 물론 Pending의 원인 분석을 가능하게 하는 연계 데이터를 함께 제공합니다. 이를 통해 클러스터 및 서비스의 가용성을 높일 수 있습니다.\\n\\n<ImgLang img=\'k8s-pending-pod-status-detail.png\' desc=\'Pending Pod 상세 분기 예시\' />\\n\\n{/* 와탭 쿠버네티스 모니터링은 2024년 상반기에 걸쳐 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 개선 작업을 진행해 왔습니다. 이번 2분기에는 그 중에서도 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 상세 내 <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능이 추가되었습니다. <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 탭을 통해 리소스 간 계층 구조와 연결 관계를 시각적으로 보다 쉽게 파악할 수 있습니다. 이를 통해 클러스터 리소스 구조와 상호 작용을 명확하게 이해하고 리소스 상태와 위치를 확인해 문제 발생 시 빠르게 대응할 수 있습니다.  */}\\n\\n와탭 쿠버네티스 모니터링은 2024년 상반기 내내 지속적인 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 개선 작업을 진행하였습니다. 특히 2분기에는 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />에 <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능이 추가되었습니다. <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> 기능을 사용하면 쿠버네티스 리소스 간 계층 구조 및 연결 관계를 시작적으로 확인할 수 있기에 쿠버네티스 환경 분석은 물론 문제 발생 시 원인 파악 및 영향도를 한 눈에 파악할 수 있습니다.\\n\\n<p align=\\"center\\"> \\n\\n![리소스 관계 분기 예시](/img/k8s-container-detail-rr-s.png)\\n\\n</p>\\n\\n{/* 쿠버네티스 리소스간 연결 관계를 시각적으로 확인할 수 있습니다. \\n\\n쿠버네티스 클러스터 내 리소스 간의 계층 구조와 연관 관계를 시각적으로 표현하여 사용자에게 제공합니다. 이를 통해 사용자는 한 눈에 Pod와 컨테이너가 어느 Node에서 실행 중인지, 어떤 Deployment에 의해 배포되었는지, 그리고 어느 Namespace에 속하는지 등의 정보를 쉽게 파악할 수 있습니다.\\n\\n\\n* 시스템 이해도 향상: 시각화된 정보를 통해 전체 클러스터의 리소스 구조와 상호 작용을 명확하게 이해할 수 있습니다.\\n\\n* 문제 진단 및 신속한 대응: 각 리소스의 상태와 위치를 시각적으로 확인하여 문제 발생 시 빠르게 대응할 수 있습니다.\\n\\n* 리소스 관리의 효율성: 클러스터 리소스의 배치와 상호 작용을 최적화하고, 운영 효율성을 높일 수 있습니다.\\n\\n이 기능을 통해 클러스터 운영 및 관리 과정에서의 효율성과 신속한 문제 해결이 가능해집니다. */}\\n\\n{/* 실시간으로 Pending 상태의 Pod 현황을 조회할 수 있으며, \\n\\n<Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> V2를 통해 클러스터 내 Pending 상태의 Pod 현황을 종합적으로 모니터링하고 분석할 수 있습니다. \\n\\n클러스터 내 Pending 상태의 Pod를 종합적으로 모니터링하고 분석할 수 있게 합니다.\\n\\n클러스터 내 Pending 상태의 Pod를 종합적으로 모니터링하고 분석할 수 있게 합니다. Pending 상태의 Pod 현황을 실시간으로 조회하여 각 Pod의 대기 원인을 상세하게 분석할 수 있으며  \\n\\n 실시간 가시성, 발생 원인 분석, 연계 데이터 제공 등을 통해 보다 종합적인 정보를 제공합니다. \\n\\n\\n컨테이너 맵 상세 내 리소스 관계를 시각적으로 확인할 수 있습니다. */}\\n\\n{/* * 에이전트 설치 개선: 에이전트 설치 복잡도 증가(k8s 플랫폼, 런타임, 기능 증가) -> ui상에서 사용자 환경 및 기능을 on/off 설정 시 설치 yaml 파일 또는 helm 차트 자동 생성해 에이전트 설치 난이도 및 사용성 개선\\n\\n  * 사용자 환경별, 다양한 와탭 옵션별 설치 yaml 자동 제공\\n\\n* Pending Pod 현황 V2: 사용자 요청으로 1회성 Pending 정보 제공 -> Pending 상태의 파드 가시성 및 발생 원인과 관련된 다양한 연계 데이터 제공으로 서비스 가용성 향상 \\n\\n  * 수집 방식으로 전환\\n\\n  * 전용 대시보드 및 분석 기능 내장 \\n\\n* 컨테이너 맵 리소스 관계도 */}\\n\\n다음 개요 안내를 통해 2024년 2분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Kubernetes_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-k8s.mdx\\";\\n\\n<Kubernetes_agent_24q2 />\\n\\n</details>\\n\\n:::note \\n\\n<Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> <code class=\\"my\\">V2</code>에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/pending-pod-status)를 참조하세요.\\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\n와탭 2024년 2분기 `Database` 부분에서 주목할 만한 신규 기능 및 변경 사항으로 **Oracle** 상품 <code class=\\"my\\">V2</code> 출시와 **Oracle Pro** 베타 출시를 소개합니다. \\n\\n와탭 데이베이스 상품군이 <code class=\\"my\\">V2</code>로 전환되고 있습니다. 1분기 **Redis**와 **MongoDB**에 뒤이어 2분기는 **Oracle** <code class=\\"my\\">V2</code> 전환이 시작되었습니다. \\n\\n![오라클 신규 분기 예시](/img/changelog/changelog-24q2-db.png) \\n\\n3분기 정식 출시를 앞두고 **Oracle Pro** **베타** 서비스가 시작되었습니다. **Oracle Pro**는 데이터베이스 서버의 메모리에 직접 접근해 성능 지표를 모니터링하는 기술을 적용하였습니다. 최신 데이터를 반영하여 정확한 성능 정보를 최대 1초에 20번까지 모니터링할 수 있으며, 디스크 I/O를 거치지 않고 메모리에 직접 접근하여 시스템 미치는 부하를 최소화합니다. 이를 통해 특정 쿼리의 실행 시간, 버커 캐시 상태 등 정밀하게 수집한 성능 정보를 바탕으로 문제를 빠르고 정확하게 분석할 수 있습니다.\\n\\n{/* * Oracle Pro\\n\\n* Oracle <code class=\\"my\\">V2</code>\\n\\n* 멀티 인스턴스 모니터링 메뉴 사용자 편의성 개선  */}\\n\\n{/* oracle pro의 경우 7월 정식 서비스 배포 예정 */}\\n\\n다음 개요 안내를 통해 2024년 2분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Database.mdx\\";\\n\\n<Database_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `DBX`\\n\\nimport DBX_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-dbx.mdx\\";\\n\\n<DBX_agent_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2024년 2분기 `Browser` 부분의 주목할 만한 신규 기능으로 <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" />를 소개합니다. 이벤트 목록만으로는 장애를 정확히 재현하기 어려울 수 있습니다. <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능은 사용자가 웹 사이트에서 수행하는 모든 이벤트를 자동으로 기록하고 재생할 수 있는 기능입니다. \\n\\n사용자의 클릭, 스크롤, 입력, 페이지 전환 등과 같은 모든 이벤트를 정확하게 재현하여 웹 사이트와 사용자 사이의 상호작용을 분석할 수 있습니다. 이를 통해 실제 사용자 경험을 재현하여 잠재적인 문제를 빠르게 식별하고 해결할 수 있으며, 사용자의 웹 사이트 사용 방식에 대한 통찰을 제공하여 최적화를 도울 수 있습니다. \\n\\n![세션 리플레이 sc](/img/changelog/changelog-24q2-browser1.png)\\n\\n{/* \\n\\n![세션 리플레이 플레이어](/img/browser-session-replay-player.png)\\n\\n사용자가 어떻게 웹 사이트를 이용하는지에 대한 통찰을 제공합니다. 이를 통해 사용자 상호작용 이해 및 최적화를 도울 수 있습니다. \\n\\n사용자 행동을 재현할 수 있으며 이를 통해 사용자가 웹 사이트와 시ㅏㄹ제로 어떻게 상호작용하는지 정확하게 파악할 수 있습니다.  \\n\\n이벤트 목록만으로는 장애를 재현하기 어려울 수 있습니다. 실제 장애가 발생했을 때 유저 화면을 녹화해 보다 정확한 장애 재현이 가능합니다.  */}\\n\\n<code class=\\"Feature\\">Feature</code> <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" /> 메뉴에 <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능 추가 <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_6_x\\"><code class=\'changelog-service\'>Service 2.6.0​</code></a></code>\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Browser.mdx\\";\\n\\n<Browser_24q2 />\\n\\n</details> */}\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-browser.mdx\\";\\n\\n<Browser_agent_24q2 />\\n\\n</details>\\n\\n:::note \\n\\n<Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/browser/session-replay)를 참조하세요.\\n\\n:::\\n\\n{/* ## `Cloud`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Cloud.mdx\\";\\n\\n<Cloud_24q2 />\\n\\n</details> */}\\n\\n<br/>\\n\\n## `Feature`\\n\\n와탭 2024년 2분기에 새롭게 제공하는 `Feature` 프로젝트를 소개합니다. 와탭은 사용자가 원하는 소프트웨어의 모니터링 지원 여부를 쉽게 확인하고 간편하게 모니터링을 시작할 수 있도록 **피쳐 프로젝트**를 도입하였습니다. 피쳐 프로젝트는 기존 모니터링 제품을 사용자가 모니터링하고자 하는 소프트웨어에 맞게 재포장해 최적화된 모니터링 솔루션을 제공합니다. \\n\\n현재 피쳐 프로젝트 방식으로 `KAFKA` 모니터링 **베타** 서비스를 시작하였습니다. 추후 정식 배포 예정이며 `KAFKA` 외 지원 범위 역시 확대될 예정입니다. \\n\\n![피쳐 프로젝트 분기 예시](/img/changelog/changelog-24q2-feature1.png) \\n\\n{/* 와탭 피쳐 프로젝트를 통해 서비스의 안정성과 성능을 더욱 효과적으로 관리해 보세요. */}\\n\\n{/* <code class=\\"Beta\\">Beta</code> `KAFKA` 모니터링 **베타** 서비스 시작  */}\\n\\n:::note \\n\\n피쳐 프로젝트와 `KAFKA` 모니터링에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/features/kafka-introduction)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n{/* <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_6_x\\"><code class=\'changelog-service\'>Service 2.6.0​</code></a></code> */}\\n\\n## `URL`\\n\\n와탭 2024년 2분기 `URL` 부분의 변경 사항을 소개합니다. <Cmdname sid=\\"side_urlList\\" className=\\"uitext\\" /> 메뉴 및 해당 메뉴 내 <Cmdname sid=\\"edit_url\\" className=\\"uitext\\" /> 창의 UI가 사용자 편의성 향상을 위해 전반적으로 개편되었습니다. 또한 <Cmdname sid=\\"TTL07886\\" className=\\"uitext\\" /> 역시 편집창이 아니라 목록 조회 시 삭제할 수 있도록 변경되었습니다. ***URL 상세*** 창의 경우 개별 비교 시 용이하도록 팝아웃 방식으로 제공합니다.\\n\\n![URL sc](/img/changelog/changelog-24q2-url.png)\\n\\n{/* * 에러 유형 안내 문서가 새로 업데이트되었습니다. 자세한 내용은 [다음 문서](https://docs.whatap.io/url/url-error-type)를 참조하세요.  */}\\n\\n{/* 부분의 주목할 만한 신규 기능으로 ~을 소개합니다.\\n\\n* 인터페이스 개선을 통해 상세창 팝아웃으로 제공\\n\\n* 상태 코드 문서 안내(첨언) */}\\n\\n다음 개요 안내를 통해 2024년 2분기 `URL` 상품의 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport URL_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-URL.mdx\\";\\n\\n<URL_24q2 />\\n\\n</details>\\n\\n:::note \\n\\n**URL 상태 코드 유형** 안내 문서가 새로 추가되었습니다. 자세한 내용은 [다음 문서](https://docs.whatap.io/url/url-http-status)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n{/* ## `Log`\\n\\n와탭 2024년 2분기 `Log` 부분의 주목할 만한 신규 기능으로 ~을 소개합니다.\\n\\n* 로그 조회 시 누적된 건수 표기 방식 변경\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Log.mdx\\";\\n\\n<Log_24q2 />\\n\\n\\n</details> */}"},{"id":"2024-1q-summary","metadata":{"permalink":"/whatap-docs/blog/2024-1q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-1q-summary.mdx","source":"@site/blog/2024-1q-summary.mdx","title":"1분기 안내","description":"와탭의 2024년 1분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-05-20T15:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2024","permalink":"/whatap-docs/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-1q-summary","title":"1분기 안내","authors":"ysj","date":"2024-05-20T15:30","toc_max_heading_level":2,"tags":["새로운 기능","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"2분기 안내","permalink":"/whatap-docs/blog/2024-2q-summary"},"nextItem":{"title":"새로운 기능이란?","permalink":"/whatap-docs/blog/index"}},"content":"와탭의 2024년 1분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n{/* 먼저 1분기 상품별 신규 기능 및 신규 상품 요약은 다음과 같습니다. 사이드 메뉴 개편 및 대시보드 고도화 작업이 이루어졌습니다.  */}\\n\\n{/* 요약은 다시 써야 함 */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> * **사이드 메뉴**가 개편되었습니다.  \\n> * 메트릭스 필드 중심의 사용자 경험을 강화한 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 기능을 새롭게 제공합니다. \\n> * **SSO 계정 연동** 기능이 추가되었습니다.\\n\\n|**Application**|\\n|---|\\n\\n> * <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴 구조를 개선했습니다. \\n> * <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />이 고도화되었습니다. \\n> * `Go` 상품 베타 서비스를 종료하고 **정식** 서비스를 제공합니다.\\n\\n|**Server**|\\n|---|\\n\\n> Unix **AIX** 에이전트 설치 패키지를 제공합니다. \\n\\n|**Kubernetes**|\\n|---|\\n\\n> * **컨트롤 플레인 모니터링**을 새롭게 제공합니다. 컨트롤 플레인 컴포넌트 중 kube-apiserver 모니터링을 위해 <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n> * 기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> 기능을 제공합니다. \\n> * Deployment 기준으로 관련 정보를 조회할 수 있는 <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n> * 마스터 및 노드 에이전트 설치 시 *Helm* 차트 설치를 지원합니다. \\n\\n|**Database**|\\n|---|\\n\\n> * `MongoDB`와 `Redis` 상품에서 차트 및 수집 기능을 강화한 새로운 <code class=\\"my\\">V2</code> 서비스를 제공합니다.\\n> * 기존에 XOS와 XOS2로 나누어져 있던 지표를 **XOS**로 통합해 백분율 표기로 확인할 수 있도록 변경했습니다. \\n\\n|**Browser**|\\n|---|\\n\\n> <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능을 새롭게 제공합니다. \\n\\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품이 **정식**으로 출시되었습니다. \\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2024년 1분기 `공통` 부분의 주목할 만한 신규 기능으로 사이드 메뉴 개편, SSO 계정 연동 기능 추가 및 새로운 이벤트 설정 기능을 소개합니다. \\n\\n사용자 편의성 향상을 위해 5년 만에 와탭 모니터링의 **사이드 메뉴**가 새롭게 개편되었습니다. 와탭 서비스 이용에는 프로젝트 선택이 선행됩니다. 프로젝트 생성 및 선택 이후 동선을 편리하게 활용할 수 있도록 기존과 비교해 UI 혼잡도를 줄여 프로젝트 선택과 메뉴의 영역을 확보하는 구조로 개편되었습니다. \\n\\n프로젝트 목록을 선택한 부분만 펼쳐서 확인할 수 있으며, 세로 영역을 확보해 보다 편하게 다양한 기능 메뉴를 조회할 수 있습니다. 또한 간단한 별 모양(<LinkImage img=\'ic-star.svg\' desc=\'비교하기 아이콘\'/>) 아이콘 클릭으로 상품별 프로젝트 메뉴 내 자주 쓰는 기능들을 즐겨찾기 할 수 있습니다. \\n\\n<ImgLang img=\'release/release-main-ui.png\' desc=\'사이드 메뉴 개편 cl 분기 예시\' />\\n\\n또한 **SSO 계정 연동 기능**이 추가되었습니다. 클라우드 기반 사용자 계정 관리 및 접근 권한 관리 솔루션 **Okta**와 와탭 모니터링을 연동할 수 있습니다. 조직 내에서 사용 중인 **Okta** 계정을 이용해 와탭 서비스에 로그인 후 서비스를 이용할 수 있습니다. \\n\\n<ImgLang img=\'sso-check-sso-info.png\' desc=\'sso-info cl 분기 예시\' />\\n\\n새로운 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> 기능은 필드(Field) 중심의 사용자 경험을 강화하여 카테고리보다 필드를 먼저 선택하는 방식으로 사용자가 인지하는 지표와 이벤트 설정의 불일치를 해소했습니다. 또한 상품에 적합한 기본 이벤트 템플릿을 제공해 보다 쉽게 경고 알림 이벤트를 설정할 수 있습니다. \\n\\n![이벤트 v2 cl 분기 예시](/img/changelog/changelog-common-event-v2.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_1q from \\"../crw-data/crwld-service/_import-service-Common.mdx\\";\\n\\n<Common_1q />\\n\\n</details>\\n\\n:::note \\n\\n* 사이드 메뉴 개편에 대한 자세한 내용은 [다음 문서](https://www.whatap.io/bbs/board.php?bo_table=blog&wr_id=214)를 참조하세요. \\n\\n* SSO 계정 연동 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/account/sso)를 참조하세요. \\n\\n* 새로운 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code>에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/warning-notice-v2)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n\\n## `Application`\\n\\n와탭 2024년 1분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 `Go` 상품의 정식 출시, <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />의 고도화, 그리고 <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴 구조의 개선을 소개합니다.  \\n\\n`Go` 애플리케이션 모니터링이 베타 버전 종료 후 **정식** 서비스를 시작했습니다. 와탭의 `Go` 애플리케이션 모니터링은 웹 프레임워크를 지원하고, Go Runtime 패키지의 정보를 지속적으로 수집합니다. 또한 MSA 환경에서 연계 추적을 통해 호출 관계를 수집합니다. \\n\\n<Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />은 성능 테스트 또는 장애 상황 발생 시 단기간 트랜잭션별 현황을 상세히 확인할 수 있는 메뉴입니다. 다음과 같이 <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 고도화 작업이 이루어졌습니다. \\n\\n기존 TX 트레이스 섹션을 제거한 대신 차트 드래그 시 <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> 팝업 창을 통해 상세 정보를 확인할 수 있도록 구조를 개선했습니다. 또한 트레이스 분석 건수를 기존 100건에서 **1000**건으로 확장해 이전보다 10배 많은 트레이스를 분석할 수 있게 되었습니다. \\n\\n그외에도 한 화면에서 필터를 적용해 동작을 최소화하는 방향으로 **필터** 기능을 개선하였습니다. 예를 들어 트랜잭션 필터를 이용해 선택한 트랜잭션만 선별해 조회할 수 있습니다. 그리고 기존 실시간 최대 5분 뿐만 아니라 과거 시점 최대 10분까지 데이터를 조회할 수 있도록 변경해 전반적으로 편의성을 향상시켰습니다.  \\n\\n {/* 그외에도 ***Top 30*** 섹션에 IP 필터 기능을 추가했고, <Cmdname sid=\\"multi_transaction\\" className=\\"uitext\\" /> 탭에서 프로잭트 선택 상태를 저장하는 등 트랜잭션 분석 시 편의성을 전반적으로 향상시켰습니다.  */}\\n\\n<ImgLang img=\'changelog/changelog-app-tx-map.png\' desc=\'sc\' className=\'changelog-img\'/>\\n\\n<Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" />와 <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> 메뉴의 경우 각 메뉴의 탭 메뉴 구성을 개별 하위 메뉴로 구성하는 등 동선과 안정성 향상을 위한 개선 작업이 이루어졌습니다.\\n\\n![통계 및 인스턴스 성능 모니터링 sc cl](/img/changelog/changelog-app-stat-instance.png)\\n\\n{/* 안정적으로 각 기능을 사용할 수 있도록 / 기존 문제 개선 및 다양한 안정화 작업을 진행했습니다. */}\\n\\n다음 개요 안내를 통해 2024년 1분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n{/* <code class=\\"New\\">New</code> `Go` 모니터링 상품 **정식 서비스** 시작 <code class=\'changelog-service\'>Service 2.2.4​</code> */}\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_1q from \\"../crw-data/crwld-service/_import-service-Application.mdx\\";\\n\\n<Application_1q />\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_1q from \\"../crw-data/crwld-agent/_import-agent-java.mdx\\";\\n\\n<Java_agent_1q />\\n\\n### `PHP`\\n\\nimport PHP_agent_1q from \\"../crw-data/crwld-agent/_import-agent-php.mdx\\";\\n\\n<PHP_agent_1q />\\n\\n### `Python`\\n\\nimport Python_agent_1q from \\"../crw-data/crwld-agent/_import-agent-python.mdx\\";\\n\\n<Python_agent_1q />\\n\\n### `Node.js`\\n\\nimport Node_agent_1q from \\"../crw-data/crwld-agent/_import-agent-nodejs.mdx\\";\\n\\n<Node_agent_1q />\\n\\n### `Go`\\n\\nimport Go_agent_1q from \\"../crw-data/crwld-agent/_import-agent-golang.mdx\\";\\n\\n<Go_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2024년 1분기 `Server` 상품의 주목할 만한 신규 기능 및 변경 사항으로 **Unix** `AIX` 설치 패키지에 대해 소개합니다. \\n\\n이번 1분기에 새롭게 **Unix** `AIX` **에이전트 설치 패키지**를 제공합니다. IBM이 개발한 AIX는 엔터프라이즈 서버에서 주로 사용됩니다. 확장성, 호환성, 엔터프라이즈 환경에서의 견고함을 위해 특별히 설계된 운영체제입니다. \\n\\n와탭은 **AIX 버전 6.1** 이상을 지원합니다. `AIX` 설치 패키지를 통해 해당 패키지를 다운로드 받은 후 실행하는 것만으로 간단하게 설치할 수 있습니다. 와탭 서버 모니터링을 통해 AIX 운영체제를 보다 효과적으로 관리하고 모니터링할 수 있습니다. \\n\\n![AIX sc cl](/img/changelog/changelog-server-aix.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_1q from \\"../crw-data/crwld-service/_import-service-Server.mdx\\";\\n\\n<Server_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_1q from \\"../crw-data/crwld-agent/_import-agent-server.mdx\\";\\n\\n<Server_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\nAIX 설치에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/server/server-os/server-aix)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2024년 1분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 새로운 기능인 **컨트롤 플레인 모니터링**, <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 그리고 개편된 기능인 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" />, 아울러 새로 추가된 **Helm** 차트 설치 지원 등에 대해서 소개합니다. \\n\\n와탭 쿠버네티스 모니터링은 이번 1분기에 새롭게 **컨트롤 플레인 모니터링**을 제공합니다. 쿠버네티스 클러스터 전반을 관리하는 컨트롤 플레인 컴포넌트 중 클러스터 내 API 요청을 처리하는 kube-apiserver에 대한 가시성 확보를 위해 <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n\\n<Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" />는 kube-apiserver의 상태 및 성능 메트릭 수집, 응답 시간, 처리량, 요청 실패 등을 추적하여 클러스터의 가용성과 성능을 모니터링할 수 있습니다. <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />를 통해서는 kube-apiserver 수집 지표 목록을 조회할 수 있습니다.\\n\\n![컨트롤 플레인 모니터링 sc cl](/img/changelog/changelog-k8s-kube-apiserver.png)\\n\\n또한 Deployment 기준으로 관련 정보를 조회할 수 있는 <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> 기능이 추가되었습니다. \\n\\n개별 Pod 보다 Pod 집합 상태를 모니터링하는 것이 서비스 안정성과 성능 확보를 위해 중요합니다. 애플리케이션 배포 및 업데이트를 담당하는 Deployment 모니터링은 그러한 의미에서 필수적입니다. <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />에서 리소스 관계도 및 클러스터 내 Pod, 컨테이너, 애플리케이션 현황 및 CPU, 메모리, 트랜잭션 수 등 주요 성능 지표를 Deployment 단위로 조회할 수 있습니다. \\n\\n또한 새롭게 추가된 <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />에서는 마스터 및 노드 에이전트 설치 현황을 한 눈에 살펴볼 수 있습니다.\\n\\n그리고 기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 각 <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> 기능을 제공합니다. <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" />은 Pod별 시작 시점 정밀 분석을 통해 기동에 소요되는 시간과 리소스 사용량에 대한 상세 데이터를 제공합니다. <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" />는 오브젝트별 과거 조회 및 비교 기능이 추가되어 클러스터 내 변동 사항을 쉽게 추적할 수 있습니다. \\n\\n![오브젝트 매니페스트 및 Pod 시작 분석 sc cl](/img/changelog/changelog-k8s-om-podinit.png)\\n\\n{/* \\n\\n뿐만 아니라 Deployment 기준으로 리소스 관계도 및 트레이스, 로그, 메트릭스와 같은 옵저버빌리티의 핵심 데이터를 한 눈에 확인할 수 있습니다. \\n\\n클러스터 관리 효율성 향상 */}\\n\\n아울러 마스터 및 노드 에이전트 설치 시 기존 Yaml 파일 방식 외 운영 복잡도를 덜어줄 **Helm** 차트 설치 방식을 공식적으로 지원합니다. \\n\\n다음 개요 안내를 통해 2024년 1분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_1q from \\"../crw-data/crwld-service/_import-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Kubernetes_agent_1q from \\"../crw-data/crwld-agent/_import-agent-k8s.mdx\\";\\n\\n<Kubernetes_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\n* <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-dashboard)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-metrics-search)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/deployment-list)를 참조하세요. \\n\\n* <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/agent-list)를 참조하세요. \\n\\n* 마스터 및 노드 에이전트 *Helm* 차트 설치 방식에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/install-master-node-agent#create-kubernetes-agent)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\n와탭 2024년 1분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 **Redis**와 **MongoDB** 상품 <code class=\\"my\\">V2</code> 출시에 대해 소개합니다.\\n\\n와탭 `Database` 상품군이  <code class=\\"my\\">V2</code>로 전환되고 있습니다. 기존 **PostgreSQL**과 **MySQL**에 뒤이어 이번 1분기에는 **Redis**와 **MongoDB** <code class=\\"my\\">V2</code> 서비스가 시작되었습니다. <code class=\\"my\\">V2</code>는 전반적으로 차트 및 수집 기능이 강화되었습니다.  \\n\\n![데이터베이스 sc cl ](/img/changelog/changelog-db.png)\\n\\n<Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> 메뉴의 UI 및 기능을 개선하였으며, 해당 메뉴에서 데이터베이스의 성능 지표 정보를 바로 확인할 수 있습니다. 또한 <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴에서 클러스터별 에이전트를 선택할 수 있습니다. 그리고 데이터베이스 로그를 검색하고 추이를 확인하고 로그 관련 알림을 받을 수 있는 <Cmdname sid=\\"side_log\\" className=\\"uitext\\" /> 메뉴를 제공합니다.\\n\\n<code class=\\"my\\">V2</code> 전환과 동시에 기존 XOS와 XOS2로 나누어져 있던 지표를 %로 확인할 수 있는 백분률 표기로 변경하고 **XOS**로 통합해 제공합니다.\\n\\n다음 개요 안내를 통해 2024년 1분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_1q from \\"../crw-data/crwld-service/_import-service-Database.mdx\\";\\n\\n<Database_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport DBX_agent_1q from \\"../crw-data/crwld-agent/_import-agent-dbx.mdx\\";\\n\\n<DBX_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2024년 1분기 `Browser` 상품의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능 및 ***사용자 정의 이벤트 수집 기능***을 소개합니다. \\n\\n이번 1분기에 새롭게 제공하는 <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> 기능은 사용자의 웹 페이지 탐색 방식을 파악하고자 할 때 활용할 수 있습니다. 사용자가 어떻게 움직이고, 어떤 페이지에 머무르고 있는지, 화면의 어떤 요소를 클릭하는지, 화면에서 발생하는 에러 등에 관한 사용자의 전반적인 활동을 분석해 사용자가 서비스를 이용하는 방식에 대한 통찰을 얻는 것뿐 아니라 사용자의 행동 패턴을 이해하는 데에 더 가까워질 수 있습니다. \\n\\n<Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />과 <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />을 이용해 사용자의 페이지 내 행동 분석 및 세션 중 발생하는 여러 에러 추적이 가능합니다. 세션 로그 정보를 통해 최종 사용자의 경로, 이탈 원인, 성능 및 사용자 경험 등을 분석할 수 있습니다. 또한 ***AJAX 히트맵***과 <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />에서 실시간으로 문제를 겪고 있는 사용자를 파악할 수 있습니다. 이러한 정보를 통해 사용자의 서비스 경험과 서비스의 현재 성능 상태를 확인할 수 있습니다.\\n\\n<ImgLang img=\'browser-search-user-session-log-analysis.png\' desc=\'사용자 세션 분석 분기 예시\' className=\'changelog-img\'/>\\n\\n***사용자 정의 이벤트 수집*** 기능은 브라우저 모니터링이 제공하는 기본 정보 외 사용자가 원하는 이벤트를 추가적으로 수집할 수 있는 인터페이스를 제공합니다. 브라우저 에이전트에서 제공하는 인터페이스 중 `addCustomEvent` 메소드를 이용해 사용자 정의형 이벤트를 수집 후 <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" /> 메뉴 또는 <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />를 통해 수집한 데이터를 조회할 수 있습니다. \\n\\n{/* 사용자가 웹 페이지를 탐색하는 방식을 이해할 수 있도록 돕습니다. 파악을 돕습니다.   */}\\n\\n다음 개요 안내를 통해 2024년 1분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_1q from \\"../crw-data/crwld-service/_import-service-Browser.mdx\\";\\n\\n<Browser_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_1q from \\"../crw-data/crwld-agent/_import-agent-browser.mdx\\";\\n\\n<Browser_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\n와탭 2024년 1분기에 네트워크 간의 혼잡 및 장애를 파악하고 사용자의 네트워크 성능 개선을 위해 프로세스의 네트워크 정보를 수집하는 **네트워크 성능 모니터링**(**Network Performance Monitoring**) 상품이 정식으로 출시되었습니다. \\n\\n![네트워크 모니터링 sc cl ](/img/changelog/changelog-network.png)\\n\\n최근 네트워크 시장은 클라우드와 가상화라는 큰 틀에서 성장하고 있습니다. 기존 장비 중심의 네트워크 모니터링 뿐만 아니라 작업을 수행하는 프로세스가 중요한 모니터링 대상이 되고 있습니다. 와탭 네트워크 성능 모니터링을 통해 프로세스 단위의 네트워크 지표를 안정적으로 모니터링해 보세요.\\n\\n와탭의 `Network` 상품은 각 프로세스가 수행하는 네트워크 동작을 추적해 복잡한 구성 요소와 상태 정보를 토폴로지를 통해 직관적으로 이해할 수 있도록 시각화했습니다. **품질 지표** ***Latency***와 ***Jitter***, 그리고 **네트워크 사용량 지표** ***bps***, ***pps***, ***session count***를 조회할 수 있습니다. 또한 태그 옵션으로 가시성을 확보하였으며, <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />를 통해 다양한 사용자 커스텀 차트를 제공합니다.\\n\\n다음 개요 안내를 통해 2024년 1분기 `Network` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</details>\\n\\n:::note \\n\\n* `Network` 상품에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/introduction)를 참조하세요. \\n\\n* AWS 리소스 식별 관련한 에이전트 옵션 안내에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/set-aws-resource-options)를 확인하세요. \\n\\n:::\\n\\n<br/>\\n\\n{/* ## `AWSLog`\\n\\n<div class=\'indentTab\'>\\n\\nimport AWSLog_1q from \\"../crw-data/crwld-service/_import-service-AWSLog.mdx\\";\\n\\n<AWSLog_1q />\\n\\n</div> <br/> */}\\n\\n## `Log`\\n\\n와탭 2024년 1분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항으로 개편된 **로그 검색 필터 기능**을 소개합니다. \\n\\n<Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_logTail\\" className=\\"uitext\\" /> 메뉴 내 **로그 검색 필터 기능**이 개편되었습니다. 검색 값 입력 시 안내 가이드 UI를 통해 지원하는 검색 문법을 확인할 수 있고, 키보드 입력으로 태그를 생성 및 수정하고 연산자를 클릭해 수정할 수 있는 기능이 추가되었습니다.\\n\\n또한 에이전트 옵션이 설정된 경우 로그 레벨(<span class=\'logwr\'>WARN</span>, <span class=\'loger\'>ERROR</span>, <span class=\'logft\'>FATAL</span>)을 수집해 로그 목록 왼쪽에서 해당 기준 색상을 표시하는 기능이 추가되었습니다.  \\n\\n![로그 에이전트 옵션 cl분기 예시 ](/img/log-agent-option-level.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_1q from \\"../crw-data/crwld-service/_import-service-Log.mdx\\";\\n\\n<Log_1q />\\n\\n</details>\\n\\n<br/>"},{"id":"index","metadata":{"permalink":"/whatap-docs/blog/index","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-index.mdx","source":"@site/blog/2024-index.mdx","title":"새로운 기능이란?","description":"{/ changelog 관련 이미지 /}","date":"2024-04-08T10:00:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"콘텐츠 구성","permalink":"/whatap-docs/blog/tags/콘텐츠-구성"}],"hasTruncateMarker":true,"authors":[{"name":"TW 팀","email":"docs@whatp.io","title":"테크니컬 라이터 팀","imageURL":"./img/teamtw.svg","key":"twt","page":null}],"frontMatter":{"slug":"index","title":"새로운 기능이란?","authors":["twt"],"date":"2024-04-08T10:00","tags":["새로운 기능","콘텐츠 구성"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"1분기 안내","permalink":"/whatap-docs/blog/2024-1q-summary"},"nextItem":{"title":"4분기 안내","permalink":"/whatap-docs/blog/2023-4q-summary"}},"content":"{/* changelog 관련 이미지 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n**새로운 기능**은 와탭 상품별 신규 기능 및 주목할 만한 변경 사항을 분기별로 안내합니다. 서비스 및 에이전트 개요를 요약해 제공합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요. \\n\\n콘텐츠 상단에서는 테이블 방식으로 해당 분기 신규 기능 및 주요 변경 사항을 간단하게 확인할 수 있습니다. 상품별 서비스 및 에이전트 안내 구성은 다음과 같습니다. \\n\\n{/* truncate */}\\n\\n{/* 콘텐츠 상단에서는 테이블 방식으로 해당 분기 신규 기능 및 주요 변경 사항을 간단하게 확인할 수 있습니다. 상품별 서비스 및 에이전트 안내 구성은 다음과 같습니다.  */}\\n\\n![새로운 기능 콘텐츠 예시 sc cl](/img/changelog/changelog-ex.png)\\n\\n해당 상품의 신규 기능 및 변경 사항을 선별해 소개하고, 해당 분기별 서비스(<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, <code class=\'Changed\'>Changed</code>) 및 에이전트(<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, <code class=\'Deprecated\'>Deprecated</code>) 전체적인 흐름을 살펴볼 수 있도록 개요를 해당 건 릴리스 버전과 함께 안내합니다. 릴리스 버전 태그(<code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0​</code></a></code>) 클릭 시 해당 버전의 릴리스 노트로 이동합니다. \\n\\n\\n{/* :::note \\n\\n개요 안내 항목의 릴리스 버전 태그 <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0​</code></a></code> 클릭 시 해당 버전의 릴리스 노트로 이동합니다.\\n\\n::: */}"},{"id":"2023-4q-summary","metadata":{"permalink":"/whatap-docs/blog/2023-4q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-4q-summary.mdx","source":"@site/blog/2023-4q-summary.mdx","title":"4분기 안내","description":"와탭의 2023년 4분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2023-12-31T15:20:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2023","permalink":"/whatap-docs/blog/tags/2023"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2023-4q-summary","title":"4분기 안내","authors":"ysj","date":"2023-12-31T15:20","toc_max_heading_level":2,"tags":["새로운 기능","2023"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"새로운 기능이란?","permalink":"/whatap-docs/blog/index"},"nextItem":{"title":"3분기 안내","permalink":"/whatap-docs/blog/2023-3q-summary"}},"content":"와탭의 2023년 4분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> * **와탭 모바일 앱**을 새롭게 출시했습니다.\\n> * 편의성 향상을 위해 <Cmdname sid=\\"platform_catalog\\" className=\\"uitext\\" /> 및 일부 메뉴의 화면을 개선했습니다. \\n> * <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" /> 메뉴 <code class=\\"my\\">V2</code>를 제공합니다.\\n\\n{/* > * <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> 메뉴 등의 화면이 개선되었습니다. */}\\n\\n|**Application**|\\n|---|\\n\\n> * <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> 기능이 개편되었습니다. \\n> * <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" />가 프리셋 방식으로 개편되었습니다. \\n\\n|**Server**|\\n|---|\\n\\n> <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> 옵션을 제공합니다.\\n\\n|**Kubernetes**|\\n|---|\\n\\n> * <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 메뉴 화면을 개선했습니다.\\n> * <Cmdname sid=\\"side_resource\\" className=\\"uitext\\" /> 하위 목록 메뉴가 추가되었습니다. \\n\\n{/* > * 통합 컨테이너 맵\\n> * 메뉴 간 동선 개편 */}\\n\\n|**Database**|\\n|---|\\n\\n> `PostgreSQL`과 `MySQL` 상품 <code class=\\"my\\">V2</code> 정식 전환 및 해당 <code class=\\"my\\">V2</code> 서비스 개선이 이루어졌습니다. \\n\\n|**Browser**|\\n|---|\\n\\n> <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" /> 메뉴를 제공합니다.\\n\\n{/* \\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품 **베타** 서비스가 출시되었습니다.  */}\\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2023년 4분기 `공통` 부분의 주목할만한 신규 기능 및 변경 사항으로 와탭 **모바일 앱**의 출시, 화면 개선 사항 및 정비 계획 <code class=\\"my\\">V2</code> 제공에 대해 소개합니다.\\n\\n이번 4분기에 와탭 **모바일 앱**이 새롭게 출시되었습니다. 앱을 통해 와탭 모니터링 서비스 <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> 주요 차트를 확인하거나 실시간으로 알림을 받을 수 있습니다. 또한 OTP 기능을 활용해 로그인 시 2차 인증 도구로 활용할 수 있습니다. 향후 업데이트를 통해 지원 범위를 확대할 예정입니다.\\n\\n![모바일 앱 sc cl](/img/changelog/changelog-mobile-app.png)\\n\\n더 나은 사용자 경험과 편의성 향상을 위해 서비스 화면을 개선했습니다. 와탭 모니터링 서비스의 정기 배포 소식 및 긴급 점검 등을 확인할 수 있는 **서비스 공지 사항** 기능이 추가되었고, 상품 카탈로그 화면이 개편되었으며, 사이드바 메뉴에서 상품 소개 정보를 확인할 수 있습니다. \\n\\n그외 <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> 등 일부 메뉴 화면 역시 개선했습니다. <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> 메뉴의 경우 결제 정보 입력 시 통화 선택을 제공합니다. <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> 메뉴의 경우 옵션 목록을 간소화해 가독성을 높였으며, 옵션 작성 시 적용된 최종 옵션 항목만 보이도록 변경되었습니다.\\n\\n기존 <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" />을 개편한 신규 <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" /> <code class=\\"my\\">V2</code>를 제공합니다. 신규 <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" />을 통해 에이전트별로 정비 계획을 추가할 수 있고, 서버 프로젝트에서도 반복 옵션을 사용할 수 있습니다. 다만 기존 정비 계획과 신규 정비 계획은 호환되지 않습니다. \\n\\n![정비 계획 sc cl](/img/changelog/changelog-maintenance-plan.png)\\n\\n다음 개요 안내를 통해 2023년 4분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Common.mdx\\";\\n\\n<Common_23q4 />\\n\\n</details>\\n\\n:::note \\n\\n* 모바일 앱에 대한 자세한 내용은 [다음 문서](../../mobile-app)를 참조하세요. 링크를 선택하거나 QR 코드를 스캔해 모바일 앱을 다운로드하세요.\\n\\n  | [iOS](https://apps.apple.com/us/app/whatap-mobile/id6450067434) | [Android](https://play.google.com/store/apps/details?id=io.whatap.lion) |\\n  | :--: | :--: |\\n  | ![QR](/img/mobile/whatap-app-ios.png) | ![QR](/img/mobile/whatap-app-android.png) |\\n\\n* 신규 <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" />에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/management/maintenance#maintenance-v2)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Applicatoin`\\n\\n와탭 2023년 4분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> 고도화에 대해 소개합니다. \\n\\n<Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> 고도화 작업의 일환으로 <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> 드래그 시 <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> 창이 개편되었습니다. <Cmdname sid=\\"multi_transaction\\" className=\\"uitext\\" /> 탭에 프로젝트 필터 기능이 추가되었고 또한 이제 ***트랜잭션 로그*** 탭에서 로그 데이터 미조회 시 상황에 알맞게 안내 메시지를 출력합니다. 예를 들어 로그 데이터가 없는 경우, 에이전트 미설정으로 수집을 하지 못 한 경우, 로그 비활성화 상태인 경우를 각각 확인할 수 있습니다. \\n\\n<Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />를 개편했습니다. 시간 선택자 옵션이 추가되어 실시간 뿐 아니라 **과거 데이터**를 조회할 수 있습니다. 그리고 대시보드 내 사용자가 원하는대로 위젯을 추가 및 삭제할 수 있고 크기 역시 조절할 수 있습니다. 편집한 위젯의 위치, 크기, 레이아웃을 저장해 불러올 수 있는 **프리셋** 기능이 추가되었습니다. \\n\\n| 과거 데이터 조회 |\\n| :--: |\\n| ![](/img/release/none-realtime-mode.png) |\\n| **대시보드 프리셋** |\\n| ![](/img/release/apm-dashboard-preset-feature.png) |\\n\\n또한 일부 애플리케이션 중복 지표 명칭에 대한 통일화 및 표준화 작업이 이루어졌습니다. 예를 들어 URL, 트랜잭션, 트랜잭션 명으로 사용되던 지표명을 <Cmdname sid=\\"side_tx\\" className=\\"uitext\\" />으로 통일했습니다. 또한 기존 HTTPC, HTTP 호출, HTTPC 건수 등으로 사용되던 지표명을 <Cmdname sid=\\"httpc_count\\" className=\\"uitext\\" />로 통일했습니다. 그외에도 다수 전반적인 용어 표준화가 이루어졌습니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Applicatoin_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Application.mdx\\";\\n\\n<Applicatoin_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-java.mdx\\";\\n\\n<Java_agent_23q4 />\\n\\n{/* ### `PHP`\\n\\nimport PHP_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-php.mdx\\";\\n\\n<PHP_agent_23q4 />\\n\\n### `Python`\\n\\nimport Python_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-python.mdx\\";\\n\\n<Python_agent_23q4 /> */}\\n\\n### `Node.js`\\n\\nimport Node_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-nodejs.mdx\\";\\n\\n<Node_agent_23q4 />\\n\\n### `.NET`\\n\\nimport DOTNET_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dotnet.mdx\\";\\n\\n<DOTNET_agent_23q4 />\\n\\n{/* ### `Go`\\n\\nimport Go_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-golang.mdx\\";\\n\\n<Go_agent_23q4 /> */}\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2023년 4분기 `Server` 상품의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"side_serverDetail\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> 메뉴 개선 사항을 소개합니다.\\n\\n<Cmdname sid=\\"side_serverDetail\\" className=\\"uitext\\" /> 메뉴에서 차트 내 x축 표시 단위를 시간 기준으로 변경해 일자 기준 뷰의 가독성을 높였습니다.\\n\\n<Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> 메뉴 내 서버 및 프로세스 이벤트에 프로젝트 특정 멤버 또는 팀 대상으로 알림 수신 여부를 설정할 수 있는 <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> 옵션이 추가되었습니다. 또한 기본 알림명을 수정할 수 있게 되었으며, 기본 알림의 경우 이제 `기본` 태그를 별도로 표시합니다.\\n\\n다음 개요 안내를 통해 2023년 4분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Server.mdx\\";\\n\\n<Server_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-server.mdx\\";\\n\\n<Server_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2023년 4분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 개선 및 추가된 <Cmdname sid=\\"side_resource\\" className=\\"uitext\\" /> 하위 목록 메뉴에 대해 소개합니다. \\n\\n{/* 와탭 쿠버네티스 모니터링 상품의 경우 통합 컨테이너 맵 개발 및 메뉴 간 동선 개편 */}\\n\\n와탭 쿠버네티스 모니터링의 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />은 지속적으로 고도화 작업이 이루어지고 있습니다. 이번 4분기에는 상세 보기 창에서 컨테이너 상 실행 중인 애플리케이션의 호출 흐름과 외부 호출 상태를 확인할 수 있는 <Cmdname sid=\\"TTL06891\\" className=\\"uitext\\" /> 탭이 새로 추가되었습니다. \\n\\n<ImgLang img=\'k8s-container-map-call-info-app.png\' desc=\'App 호출 흐름도 분기 예시\' /> \\n\\n또한 컨테이너와 Pod 뷰 모두 블록 색상 표시 지표에 애플리케이션 관련 필드 목록(`app_counter`)을 선택할 수 있습니다. 그리고 1분간 사라진 컨테이너 및 Pod의 블록을 표시하는 기능이 추가되었습니다. \\n\\n뿐만 아니라 <Cmdname sid=\\"side_resource\\" className=\\"uitext\\" /> 하위의 목록 메뉴가 개편 및 새로 추가되었습니다. <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> 메뉴는 노드 정보 지표, 필터 검색 기능이 추가되었습니다. 또한 시간 갱신 간격이 1분에서 10초로 변경되었습니다. 클러스터와 관련된 버전 정보 및 각종 오브젝트 정보를 한 눈에 확인할 수 있는 <Cmdname sid=\\"side_clusterOverview\\" className=\\"uitext\\" /> 메뉴가 새로 추가되었습니다. \\n\\n새롭게 네임스페이스 프로젝트의 <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" />에 <Cmdname sid=\\"pendingPod\\" className=\\"uitext\\" /> 메뉴가 추가되었습니다. <Cmdname sid=\\"pendingPod\\" className=\\"uitext\\" /> 메뉴는 Pending 상태에 놓인 Pod를 빠르게 파악하기 위한 실험 기능입니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.8</code> <code class=\'changelog-date\'>2023년 10월 04일</code>\\n\\n- <Status>Feature</Status> 파드(Pod) 목록 신규 개발을 위한 데이터 추가 수집(podIp, age, restartCount)\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.1</code> <code class=\'changelog-date\'>2023년 11월 08일</code>\\n\\n- <Status>Feature</Status> 쿠버네티스의 클러스터 정보 추가\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.2</code> <code class=\'changelog-date\'>2023년 11월 16일</code>\\n\\n- <Status>Feature</Status> <code>kube_pod</code> 카테고리에 수집 데이터 추가\\n\\n  - <code>qosClass</code>: Pod에 대한 서비스 품질\\n  - <code>startTime</code>: Pod 시작 시간\\n  - <code>podHash</code>: Pod 이름의 해시값\\n  - <code>con_cpu_limit_total</code>: Pod 내부 컨테이너의 cpu limit 합계\\n  - <code>con_mem_alloc_fail_total_count</code>: Pod 내부 컨테이너의 memory 할당 실패 수 합계\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Database`\\n\\n와탭 2023년 4분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다. \\n\\n이번 4분기에 `Database` 상품군 중 **PostgreSQL**와 **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 정식 서비스로 전환되었습니다. 그리고 기존 **MS SQL Server** 상품의 이름을 **SQL Server**로 변경했습니다.\\n{/* 먼저 **PostgreSQL**에 뒤이어 이번 4분기에 `Database` 상품군 중 **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 정식 서비스로 전환되었습니다. 그리고 기존 **MS SQL Server** 상품의 이름을 **SQL Server**로 변경했습니다.  */}\\n\\n`Database` 상품군 공통으로 사용자 편의성 향상을 위해 <Cmdname sid=\\"TTL06224\\" className=\\"uitext\\" /> 메뉴 화면의 UI가 개선되었습니다. 쿼리 조회 영역과 Plan 조회 영역 배치를 사용자가 수정할 수 있고, 파라미터 바인드를 기본 수행하도록 변경되었습니다. 또한 <Cmdname sid=\\"side_dbMonitoring\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> 메뉴에서 액티브 세션 테이블을 접어 그래프 차트를 더 넓게 확인할 수 있습니다.\\n\\n다음 개요 안내를 통해 2023년 4분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Database.mdx\\";\\n\\n<Database_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dbx.mdx\\";\\n\\n<DBX_agent_23q4 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-xos.mdx\\";\\n\\n<XOS_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `URL`\\n\\n와탭 2023년 4분기 `URL` 상품의 경우 모니터링 데이터를 수집하는 간격을 선택할 수 있는 UI가 새로 추가되었습니다. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport URL_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-URL.mdx\\";\\n\\n<URL_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2023년 4분기 `Browser` 상품의 주목할 만한 신규 기능으로 <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />을 소개합니다.\\n\\nAsynchronous JavaScript and XML(**AJAX**)는 비동기 방식으로 데이터를 교환해 웹 페이지를 업데이트하는 기술입니다. 사용자 경험을 개선하고 서버로의 요청을 줄이는 장점을 가진 AJAX는 JavaScript 코드로 구현되기에 모니터링이 필요합니다. \\n\\n와탭 `Browser` 모니터링이 제공하는 <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" /> 메뉴를 통해 시간에 따른 AJAX 이벤트의 응답 시간을 히트맵 차트로 확인할 수 있으며 각 이벤트 구간별 세부 시간 정보, AJAX 요청 URL 및 호출 페이지 정보, 에러 메시지 및 상태 코드 등의 상세 정보를 조회할 수 있습니다. \\n\\n![AJAX 히트맵 sc cl](/img/changelog/changelog-browser-ajax.png)\\n\\n다음 개요 안내를 통해 2023년 4분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Browser.mdx\\";\\n\\n<Browser_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-browser.mdx\\";\\n\\n<Browser_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Cloud`\\n\\n와탭 2023년 4분기 `Cloud` 상품의 경우 프로젝트 내에서 사용자가 수행하는 상호 작용을 감지해 사용자 행동에 대한 통찰을 제공하는 <Cmdname sid=\\"side_userBehavior\\" className=\\"uitext\\" /> 메뉴가 새로 추가되었습니다. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Cloud.mdx\\";\\n\\n<Cloud_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\n와탭 2023년 4분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다.\\n\\n<Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> 메뉴에서 로그 검색 필터 문법을 안내하는 **가이드 UI**가 추가되었습니다. 가이드 UI를 통해 검색 값 입력 시 지원하는 검색 문법을 확인할 수 있습니다.\\n\\n<ImgLang img=\'log-filter-ui1.png\' desc=\'로그 필터 cl 분기 예시\'/>\\n\\n그리고 타임스탬프와 로그만을 확인할 수 있도록 전체 화면 전환 기능이 추가되었으며, 로그 1차 파서 설정 탭에서 파서 추가 시 로그 검출 조건의 검색 값 입력 후 예약어에 대한 유효성 검증이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Log.mdx\\";\\n\\n<Log_23q4 />\\n\\n</details>\\n\\n<br/>"},{"id":"2023-3q-summary","metadata":{"permalink":"/whatap-docs/blog/2023-3q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-3q-summary.mdx","source":"@site/blog/2023-3q-summary.mdx","title":"3분기 안내","description":"와탭의 2023년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2023-10-31T15:10:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"2023","permalink":"/whatap-docs/blog/tags/2023"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2023-3q-summary","title":"3분기 안내","authors":"ysj","date":"2023-10-31T15:10","toc_max_heading_level":2,"tags":["새로운 기능","2023"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"4분기 안내","permalink":"/whatap-docs/blog/2023-4q-summary"}},"content":"와탭의 2023년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'새로운 기능 sc\' />\\n\\n{/* truncate */}\\n\\n{/* db 상품 중 mysql v2 서비스 제공 시점 확인 필요 */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> **프로젝트 플렉스 보드 편집** 권한이 추가되었습니다.\\n\\n|**Application**|\\n|---|\\n\\n> * <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> 기능이 새롭게 개편되었습니다.\\n> * <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 메뉴 맵 차트가 개선되었습니다. \\n\\n|**Server**|\\n|---|\\n\\n> <Cmdname sid=\\"sms_resource_board\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다.\\n\\n|**Kubernetes**|\\n|---|\\n\\n> * ***Docker PHP*** 설치를 제공합니다.\\n> * <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> 메뉴를 제공합니다.\\n{/* > * <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> 및 <Cmdname sid=\\"side_perfSummary\\" className=\\"uitext\\" /> 메뉴가 개선되었습니다. */}\\n\\n|**Database**|\\n|---|\\n\\n> * **PostgreSQL** 상품 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다.\\n> * **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다.\\n\\n|**Browser**|\\n|---|\\n\\n> * ***페이지로드 히트맵*** 메뉴가 개선되었습니다. \\n> * <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" /> 메뉴에서 에러 상세가 추가되었습니다. \\n\\n|**AWS Log**|\\n|---|\\n\\n> `AWS Log` 모니터링 상품 **정식** 서비스가 출시되었습니다. \\n\\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품 베타 서비스가 시작되었습니다. \\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2023년 3분기 `공통` 부분의 주목할만한 신규 기능 및 변경 사항으로 **프로젝트 플렉스보드 편집** 권한 추가 및 편의성 향상을 위한 개선을 소개합니다.\\n\\n**프로젝트 플렉스보드 편집** 권한이 추가되어 이제 프로젝트 내 ***Flex 보드***를 수정하기 위해서는 해당 권한이 필요합니다. \\n\\n그외 전반적인 편의성 향상을 위한 업데이트가 이루어졌습니다. 와탭의 서비스 버전과 상품 목록을 확인할 수 있는 <Cmdname sid=\\"BTN06853\\" className=\\"uitext\\" /> 메뉴가 추가되었습니다. \\n\\n<LinkImage img=\'changelog/changelog-whatap-info.png\' desc=\'\' className=\'noneborder\' />\\n\\n또한  <Cmdname sid=\\"side_eventNoti\\" className=\\"uitext\\" /> 시 **WhatsApp** 알림 설정이 새롭게 추가되었고 <Cmdname sid=\\"side_integratedReport\\" className=\\"uitext\\" /> 메뉴에서 일간 보고서 생성 시 시간 선택 제한 방식이 변경되었습니다. 기존에는 종료 시간을 전일 23시 59분까지 선택할 수 있었지만, 이제 종료 시간을 현재 시간 기준 1시간 이전까지 선택할 수 있습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Common.mdx\\";\\n\\n<Common_23q3 />\\n\\n</details>\\n<br/>\\n\\n## `Applicatoin`\\n\\n와탭 2023년 3분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 ***트랜잭션 분석*** 기능 개편 및 <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> 화면 개선에 대해 소개합니다. \\n\\n***트랜잭션 분석*** 기능 개편이 시작되었습니다. 기존에는 <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> 아래로 트랜잭션 목록을 불러오는 방식이었지만, 이제 <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> 드래그 시 ***트랜잭션 분석*** 팝업창이 나타나 구간별로 해당 상세 정보를 분석하고 비교하기 수월해졌습니다. 또한 트랜잭션 목록 필터에서 에러 건만 바로 확인할 수 있는 옵션이 추가되었습니다.\\n\\n<LinkImage img=\'release/release-note-tx-new-feature.png\' desc=\'\' className=\'noneborder\' />\\n\\n<Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />은 가시성을 높이기 위해 맵 디자인을 변경하였으며, 일반 트랜잭션과 에러 트랜잭션이 겹치는 경우 에러 건이 먼저 보이도록 변경되었습니다.\\n\\n  | 수정 전 | 수정 후 |\\n  | :--: | :--: |\\n  | ![before](/img/release/before-transaction-chart.png) | ![after](/img/release/after-transaction-chart.png) |\\n\\n또한 `.NET` 상품의 경우 기존에 `Java`와 `Python` 상품에서만 제공되었던 <Cmdname sid=\\"side_stack\\" className=\\"uitext\\" /> 메뉴가 추가되었습니다. <Cmdname sid=\\"side_stack\\" className=\\"uitext\\" /> 메뉴를 통해 <Cmdname sid=\\"topstack\\" className=\\"uitext\\" />과 <Cmdname sid=\\"uniquestack\\" className=\\"uitext\\" />, <Cmdname sid=\\"active_stack\\" className=\\"uitext\\" />을 간단하게 확인할 수 있습니다.\\n\\n다음 개요 안내를 통해 2023년 3분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application.mdx\\";\\n\\n<Application_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-java.mdx\\";\\n\\n<Java_agent_23q3 />\\n\\n### `PHP`\\n\\n#### <code class=\'changelog-service\'>PHP Agent v2.6.2</code> <code class=\'changelog-date\'>2023년 9월 13일</code>\\n\\n* <Status>Feature</Status> 대용량 프로파일 처리 옵션 추가\\n\\n  - **whatap.large_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    기본값 `false`\\n\\n    약 만 건 이하의 프로파일(스탭) 정보를 수집할 수 있습니다. 더 많은 양을 수집할 경우 `split_profile_enabled` 옵션으로 사용하는 것을 권장합니다.\\n\\n  - **whatap.split_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    기본값 `false`\\n\\n    일정량의 프로파일을 가상 트랜잭션으로 분리하여 더 많은 프로파일 정보를 수집합니다. 여러 개의 트랜잭션 목록으로 분할 표기합니다.\\n\\n* <Status>Feature</Status> 프로파일 데이터 압축 전송 옵션 추가\\n\\n  * **whatap.profile_zip_enabled** <span class=\'type\'>Boolean</span>  기본값 `true`\\n\\n### `.NET`\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.1</code> <code class=\'changelog-date\'>2023년 7월 17일</code>\\n\\n* <Status>New</Status> Active Stack 지원\\n\\n* <Status>New</Status> 닷넷 지원환경 분석 도구 기능 추가\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.2</code> <code class=\'changelog-date\'>2023년 7월 20일</code>\\n\\n* <Status>New</Status> WCF 지원\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.5</code> <code class=\'changelog-date\'>2023년 9월 13일</code>\\n\\n- <Status>New</Status> 타임아웃 시간 조절하는 <code>webservice_method_timeout</code> 옵션 추가\\n\\n### `Go`\\n\\nimport Go_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-golang.mdx\\";\\n\\n<Go_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `Application`, `Container`, `Server`\\n\\nimport ApplicationContainerServer_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application-Container-Server.mdx\\";\\n\\n<ApplicationContainerServer_23q3 /> */}\\n\\n## `Server`\\n\\n와탭 2023년 3분기 `Server` 상품의 경우 <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> 메뉴에서 기존 이벤트 설정을 현재 프로젝트에 복사할 수 있는 기능이 추가되었고, 그외 <Cmdname sid=\\"sms_resource_board\\" className=\\"uitext\\" /> 메뉴 내 에이전트 상태 위젯에 위험과 경고 상태가 구분되어 표시도록 하는 등 사용자 편의성 향상을 위한 개선 작업이 이루어졌습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Server.mdx\\";\\n\\n<Server_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Kubernetes`\\n\\n와탭 2023년 3분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 **Docker PHP** 설치 제공 및 새롭게 추가된 <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> 메뉴를 소개합니다.\\n\\n{/* ***컨테이너 맵*** 및 <Cmdname sid=\\"side_perfSummary\\" className=\\"uitext\\" /> 메뉴의 개선에 대해 소개합니다. */}\\n\\n이제 Docker 컨테이너 기반으로 실행하는 **PHP 애플리케이션**에 와탭 모니터링 에이전트를 적용하고 컨테이너 이미지를 패키징할 수 있습니다. whatap-php 패키지를 설치 후 설치 스크립트 및 컨테이너 환경변수를 설정해 해당 에이전트를 설치할 수 있습니다. \\n\\n클러스터 프로젝트와 네임스페이스 프로젝트를 포함한 <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> 메뉴를 새롭게 제공합니다. 통합 컨테이너 맵은 프로젝트별 그룹화 옵션을 추가로 제공해 클러스터 프로젝트 및 네임스페이스 개별 프로젝트 내 컨테이너 맵을 조회할 수 있습니다.\\n\\n<LinkImage img=\'k8s-container-map-unified-whatapproject.png\' desc=\'\' className=\'noneborder\' />\\n\\n다음 개요 안내를 통해 2023년 3분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Container_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Container.mdx\\";\\n\\n<Container_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.6</code> <code class=\'changelog-date\'>2023년 9월 25일</code>\\n\\n- <Status>Feature</Status> 노드 목록 개편을 위한 노드 정보(클러스터 버전, 노드 상태 등) 추가\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.7</code> <code class=\'changelog-date\'>2023년 9월 27일</code>\\n\\n- <Status>Feature</Status> 개편될 애플리케이션 목록 메뉴에서 노드 목록 연동을 위한 key 값 추가\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Database`\\n\\n와탭 2023년 3분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 <code class=\\"my\\">V2</code> 서비스 시작에 대해서 소개합니다.\\n\\n이번 3분기에 `PostgreSQL` 상품과 `MySQL` 상품의 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다. <code class=\\"my\\">V2</code> 서비스는 편의성 향상에 중점을 두었습니다. \\n\\n제품 환경별로 RDS와 XOS 탭을 분리하였고 또한 <Cmdname sid=\\"side_dbMonitoring\\" className=\\"uitext\\" /> 메뉴를 개선했습니다. 예를 들어 액티브 세션 테이블 프리셋 저장 옵션 및 세션 상세 정보 내 Plan 조회 옵션 등이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Database.mdx\\";\\n\\n<Database_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-dbx.mdx\\";\\n\\n<DBX_agent_23q3 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-xos.mdx\\";\\n\\n<XOS_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2023년 3분기 `Browser` 상품의 주목할 만한 신규 기능 및 변경 사항으로 ***페이지로드 히트맵*** 메뉴 개선 및 <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" /> 에러 상세 추가에 대해 소개합니다.\\n\\n***페이지로드 히트맵*** 메뉴의 경우 상세 페이지로드 데이터에 운영체제 버전 및 클라이언트 IP 정보가 추가되었고 필터 기능을 새롭게 제공합니다.\\n\\n이제 <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" /> 메뉴의 ***에러 메시지 테이블*** 목록에서 에러 메시지를 선택 시 에러 메시지를 기준으로 에러와 관련한 자세한 통계 정보를 확인할 수 있습니다. 뿐만 아니라 시간대별로 발생한 에러 로그 역시 살펴볼 수 있습니다.\\n\\n<LinkImage img=\'browser-error-details-log.png\' desc=\'Error log 분기 예시\' />\\n\\n다음 개요 안내를 통해 2023년 3분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Browser.mdx\\";\\n\\n<Browser_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-browser.mdx\\";\\n\\n<Browser_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\n와탭 2023년 3분기에 네트워크 간의 혼잡 및 장애를 파악하고 사용자의 네트워크 성능 개선을 위해 프로세스의 네트워크 정보를 수집하는 **네트워크 성능 모니터링**(**Network Performance Monitoring**) 상품 베타 서비스가 출시되었습니다. 상품에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/introduction)를 참조하세요. \\n\\n<br/>\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</div>  */}\\n\\n{/* ## `CloudWatch`, `AZURE`, `OCI`, `NCP`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-CloudWatch-AZURE-OCI-NCP.mdx\\";\\n\\n<Cloud_23q3 />\\n\\n</div><br/> */}\\n\\n## `AWS Log`\\n\\n와탭 2023년 3분기 `AWS Log` 모니터링 서비스가 정식으로 출시되었습니다. S3와 Log Group 각각 리소스별로 확인하는 번거로운 과정을 거칠 필요없이 와탭 `AWS Log`는 AWS 상에서 발생하는 각종 로그를 수집해 통합 모니터링을 제공합니다. 상품에 대한 자세한 내용은 <a href=\\"../../aws-log/introduction\\">다음 문서</a>를 참조하세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport AWSLog_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-AWSLog.mdx\\";\\n\\n<AWSLog_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\n와탭 2023년 3분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다. \\n\\n전반적으로 편의성 향상을 위한 업데이트가 이루어졌습니다. <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_logExplorer\\" className=\\"uitext\\" />, <Cmdname sid=\\"transaction_log\\" className=\\"uitext\\" /> 메뉴에서 키워드 하이라이팅 기능이 추가되었습니다. 또한 <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> 메뉴에서 인접 로그 조회 기능이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Log.mdx\\";\\n\\n<Log_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `실험실`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Lab_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Lab.mdx\\";\\n\\n<Lab_23q3 />\\n\\n</div><br/> */}"}]}}');

